INSERT INTO `event_sites` VALUES (1,36,'marcom.id','kerenbanget','Indonesia MarkPlus Festival - Surabaya HUMAN 5.0','Indonesia MarkPlus Festival - Surabaya HUMAN 5.0','<p>Dengan tema <strong>“ENTREPRENEURIAL MARKETING: JURUS JITU JATIM BANGKIT”</strong>. MarkPlus akan mengupas strategi bangkit di era pasca pandemi melalui jurus-jurus jitu <strong>CI-EL </strong>(<i>Creativity, Innovation, Entrepreneurship dan Leadership</i>). Dapatkan strategi untuk menemukan dan mengeksekusi peluang baru agar bisnis Anda dapat kembali maju. Lengkap bersama contoh praktis dari pelaku bisnis lokal dan nasional! Jangan lewatkan pula inspirasi dari para penerima penghargaan <strong>Industry Marketing Champion 2022</strong> di daerah anda di pandu langsung oleh Bapak Hermawan Kartajaya – <i>Founder &amp; Chairman </i>MarkPlus Inc dan Dr. Jacky Murry – <i>CEO </i>MarkPlus Inc.</p><p>Segera bergabung di Festival Pemasaran terbesar &amp; terakbar di Indonesia</p><p>Syarat &amp; Ketentuan</p><ol><li>Tiket ini berlaku untuk 1 (satu) orang dan satu kali pemakaian.</li><li>Tidak berlaku refund</li><li>Tidak ada penggantian program bagi peserta yang berhalangan hadir.</li><li>Dengan membeli E-Ticket dianggap mengerti &amp; menyetujui syarat dan ketentuan yang berlaku.</li><li>Peserta diharapkan hadir langsung pada tanggal dan waktu yang tertera karena acara akan dilaksanakan secara offline dan tidak terdapat tayangan ulang ataupun memperoleh recording dari acara.</li></ol>','conference','2022-08-27 01:22:03','2022-08-27 01:22:03');
/*!40000 ALTER TABLE `event_sites` ENABLE KEYS */;
