INSERT INTO `events` VALUES (1,1,'jakarta-fair-kemayoran-2022','Jakarta Fair Kemayoran - 2022','Exhibition','Exhibition','Pameran & Hiburan Terbesar, Terlengkap, Terlama','20220605103439.png','<p>Jakarta Fair Kemayoran (JFK) akan kembali hadir untuk menghibur masyarakat pada pertengahan tahun ini. Event akbar ini akan digelar selama 39 hari mulai tanggal 9 Juni hingga 17 Juli 2022 mendatang. Sebagai ajang arena pameran dan hiburan terbesar se-Asia Tenggara, Jakarta Fair Kemayoran akan digelar dengan berbagai konten acara serta sajian hiburan yang pastinya lebih menarik dari penyelenggaraan tahun-tahun sebelumnya.</p>','offline','<p>Arena JIExpo Kemayoran; Jakarta 10620, Indonesia</p>','DKI Jakarta','Jakarta Selatan','2022-06-09','2022-07-17','10:00:00','22:00:00',1,'Stage and Session Sponsors Exihibitors Media Partner','https://www.instagram.com/jakartafairid','https://twitter.com/jakartafairid','https://www.jakartafair.co.id/',0,'2022-06-09 12:00:14','2022-06-28 14:32:10',NULL,3,NULL),(2,1,'bri-konserjudika-di-ngopibareng-pintulangit','BRI KonserJUDIKA di Ngopibareng Pintulangit','Concert','Live Music / Music Conser','Musik Untuk Semua','20220606162535_629dc80f69e87.jpg','<p>BRI mempersembahkan konser JUDIKA di Ngopibareng Pintulangit, Prigen, Pasuruan</p><p>Hari/Tanggal: Rabu, 29 Juni 2022</p><p>Jam: 19.00 - selesai</p><p>Tiket:</p><ul><li>VVIP, VIP dan FESTIVAL berdiri</li><li>TRIBUN duduk</li></ul><p>---</p><p>Syarat &amp; Ketentuan</p><p>1. Barcode/tiket reservasi tidak perlu di print dan cukup ditunjukkan kepada petugas menggunakan smart phone masing-masing saat memasuki area Ngopibareng Pintulangit dengan bersedia mengantri dan tertib.</p><p>2. Penonton wajib menggunakan masker dan menjaga protokol kesehatan</p><p>3. Jika kapasitas parkir Ngopibareng Pintulangit telah mencapai batas maksimum, maka akan dilayani oleh warga sekitar yang bekerja sama dengan petugas parkir Ngopibareng Pintulangit.<br>Parkir mobil 10.000<br>Parkir Motor 5.000</p>','offline','<p>Ngopibareng Pintulangit, Prigen, Pasuruan</p>','Jawa Timur','Pasuruan','2022-06-29','2022-06-29','19:00:00','23:00:00',1,'Stage and Session Sponsors','https://instagram.com/ngopibarengpintulangit','https://twitter.com/','https://ngopibarengpintulangit.com',0,'2022-06-09 12:39:38','2022-09-15 19:32:07',NULL,0,'xAOsuHOGhA166324512715-Sep-2022'),(3,2,'bus-surabaya-shoping-culinary-track27-08-22_08:37:45_12','Bus Surabaya Shoping & Culinary Track','Atraction & Themepark','Attraction',NULL,'bus surabaya shopping (2).jpeg','<p>Bus Surabaya Shoping &amp; Culinary Track, Kompleks Balai Pemuda</p>','offline','<p>Jl. Gubernur Suryo No. 15, Surabaya</p>','Jawa Timur','Surabaya','2022-10-21','2022-11-30','09:00:00','21:00:00',1,'KOSONG','https://instagram.com/agendakota','https://twitter.com/agendakotaid','https://agendakota.id',0,'2022-06-10 18:14:29','2022-10-21 10:41:23',NULL,0,'1MPrfdsDgC166047777914-Aug-2022'),(4,2,'surabaya-north-quay27-08-22_08:37:25_12','Surabaya North Quay','Atraction & Themepark','Attraction',NULL,'north quay (2).jpg','<p>Kota Surabaya punya berbagai macam destinasi wisata yang menarik dan <i>spot sunse</i>t yang cukup cantik, salah satunya adalah di Surabaya North Quay. Tepatnya berlokasi Pelabuhan Gapura Surya lantai dua dan tiga. Tempat ini dibuka untuk umum dan tentunya sangat cocok untuk kamu yang ingin <i>refreshing </i>di akhir pekan.</p><p>Sesuai namanya, Surabaya North Quay menyuguhkan wisata maritim yang komplit. Fasilitas yang disediakan ada ruang tunggu, <i>foodcourt</i>, garbarata, ruangan dengan <i>wifi</i> gratis dan lain lain. Yang wajib dikunjungi adalah area <i>rooftop</i>. Kamu akan disuguhi pemandangan hamparan laut yang luas, dilengkapi dengan kapal-kapal yang akan bersandar di pelabuhan. <i>Spot</i> di <i>rooftop</i> ini sangat cocok dikunjungi di sore hari menjelang matahari terbenam. Dan jika sedang ada Kapal Pesiar yang sedang bersandar, kalian wajib datang karena momen tersebut adalah sangat langka dan jarang terjadi.<br>Yuk, nikmati senja bersama orang-orang tersayang di Surabaya North Quay!</p>','offline','<p>Surabaya North Quay, Tanjung Perak Surabaya</p>','Jawa Timur','Surabaya','2022-10-21','2022-11-30','09:00:00','21:00:00',1,'KOSONG','https://instagram.com/agendakota','https://twitter.com/agendakotaid','https://agendakota.id',0,'2022-06-10 18:26:18','2022-10-21 10:32:10',NULL,0,'ZPyNN2zpYI166156413527-Aug-2022'),(5,2,'wisata-perahu-kalimas27-08-22_08:35:24_12','Wisata Perahu Kalimas','Atraction & Themepark','Attraction',NULL,'perahu.jpg','<p>Wisata perahu kalimas rute ini menawarkan nuansa lampu lampion di sepanjang rute Monumen Kapal Selam sampai Dermaga SIOLA.&nbsp;</p><p>Anda dapat menikmati spot foto di Air Mancur Patung Suroboyo, Taman Skate &amp; BMX, Pasar Apung, Museum Pendidikan dan Dermaga Siola. Wisata ini sudah termasuk tiket masuk Monumen Kapal Selam. Pintu masuk dan titik akhir dari rute ini adalah Monumen Kapal Selam.</p>','offline','<p>Jl. Pemuda No. 39</p>','Jawa Timur','Surabaya','2022-10-21','2022-11-30','09:00:00','19:00:00',1,'KOSONG','https://instagram.com/agendakota','https://twitter.com/agendakotaid','https://agendakota.id',0,'2022-06-10 18:35:06','2022-10-21 10:24:16',NULL,0,'Ucl40UiLl8166074726017-Aug-2022'),(7,1,'food-hotel-indonesia','Food & Hotel Indonesia','Exhibition','Exhibition',NULL,'Food hotel indonesia.JPG','<p>Food &amp; Hotel Indonesia is the country’s leading international food and hospitality event, attracting key trade-only buyers from all sectors of the hospitality and retail industry, FHI gives international companies an undisputed entry point into this thriving and lucrative market. The show will be attended by decision makers, major importers, distributors and agents with the last edition attracting 35,950 attendees worldwide.&nbsp;</p><p>The value of Indonesia’s food &amp; beverage imports is on track to quadruple in the next decade, with rising consumption of foodstuffs such as meat, dairy, confectionery &amp; ‘well-being’ products offering unprecedented demand for international suppliers.</p>','offline','<p>Jakarta International Expo, Indonesia</p>','DKI Jakarta','Jakarta Pusat','2022-07-26','2022-07-29','10:00:00','22:00:00',1,'Sponsors','https://www.instagram.com/foodhotelindonesia_fhi/','https://twitter.com/foodhotelindonesia','https://www.foodhotelindonesia.com/',0,'2022-06-15 13:37:26','2022-06-17 19:22:46',NULL,0,NULL),(8,1,'effective-communication22-09-22_00:26:57_11','EFFECTIVE COMMUNICATION','Workshop','Workshop',NULL,'poster communication.jpg','<p>Kemampuan komunikasi efektif dibutuhkan oleh semua orang di dalam dunia kerja modern yang dinamis. Kemampuan komunikasi efektif digunakan sehari-hari dalam hal presentasi bisnis, penjualan, dan negosiasi. Kemampuan komunikasi efektif perlu senantiasa diasah untuk peningkatan kompetensi dan produktifitas. Seberapa efektifkah komunikasi kita di tempat kerja saat ini?</p><p>Yuk ikuti Live Zoom Webinar dari Dilantern yang akan mengulas hal ini bersama Pakar Praktisi di bidangnya</p><p>Senin 27 Juni 2022, Pkl 18.00 – 20.00 WIB</p><p>#RaihKarirmu. Dapatkan ilmu bermanfaat. Jalin komunitas pertemanan baru</p><p>Daftar segera karena kuota peserta terbatas!</p><p>Syarat &amp; Ketentuan</p><p><strong>Link Live Zoom</strong> akan diinformasikan pada <strong>e-ticket (WatchHere)&nbsp;</strong>dalam email yang dikirimkan oleh Loket.com setelah proses pembelian tiket berhasil dilakukan</p>','online','-','DKI Jakarta','Jakarta Selatan','2022-06-27','2022-06-27','18:00:00','20:00:00',1,'KOSONG','https://instagram.com/dilantern_',NULL,NULL,0,'2022-06-21 11:08:58','2022-09-22 00:26:57',NULL,0,'XcK8bXYgjc166080416018-Aug-2022'),(9,1,'regular-technical-analyst-rta-batch-17-bnsp','Regular Technical Analyst (RTA) Batch 17 - BNSP','Seminar & Talkshow','Seminar',NULL,'pelatihan sertifikasi kompetensi profesi.jpg','<h3><strong>Tentang Sertifikasi Analis Efek Madya / Regular Technical Analyst (RTA)</strong></h3><h3><strong>Apa itu Regular Technical Analyst (RTA) ?</strong></h3><p>Kompetensi sebagai Profesional Analis Teknikal Madya / Regular Technical Analyst (RTA) merupakan orang yang mampu menangani analisa secara teknikal baik untuk Pasar Saham, Obligasi, Maupun instrument lainnya seperti Currency dan commodity. Ruang lingkup pekerjaan Analis Teknikal juga sangat dibutuhkan di industri keuangan khususnya Perusahaan Sekuritas, Perusahaan Aset Manajemen, Perusahaan Dana Pensiun.</p><p>Sertifikasi profesi Analis Teknikal atau Registered Technical Analyst (RTA) di keluarkan oleh Lembaga Sertifikasi Pasar Modal (LSP-PM) yang sudah terstandarisasi oleh Badan Nasional Sertifikasi Profesi (BNSP).</p><h3><strong>Hasil yang diharapakan dari program sertifikasi RTA</strong></h3><ol><li>Mampu menjelaskan Pengertian dan Penggunaan Analisis Teknikal</li><li>Mampu mengkonstruksi Grafik (Chart)</li><li>Mampu menganalisis Kecenderungan Pergerakan Harga (Trend &amp; Reversale)</li><li>Mampu menganalisis Support &amp; Resistance</li><li>Mampu menganalisis Kekuatan dan Volatilitas</li><li>Mampu menganalisis Pola Grafik (Chart Pattern)</li><li>Mampu menganalisis Indikator Teknikal</li></ol><h3><strong>Silabus Materi RTA</strong></h3><p>Materi yang kamu pelajari sudah terstandarisasi oleh BNSP.</p><ol><li>Introduction Technical Analyst</li><li>Basic Technical Analyst</li><li>Construction Chart</li><li>Bullish &amp; Bearish</li><li>Trend &amp; Reversale</li><li>Support &amp; Resistance</li><li>Volatilty Analyst</li><li>Chart Pattern</li><li>Indicator Technical Analyst</li><li>Cases</li></ol><h3><strong>Pengajar Regular Technical Analyst (RTA)</strong></h3><p><strong>DR (Can). Lucky Bayu Purnomo SE, ME, CSA, CTA</strong></p><p>Lucky Bayu Purnomo merupakan seorang Ekonom dan juga Dosen Magister ilmu keuangan perbankan dan Pasar Modal. Beliau juga sudah menulis beberapa buku terkait pasar modal di antaranya yaitu Kaya menjadi juragan saham, Rahasian di Balik Pergerakan Harga Saham dan Menjadi Raja Minyak Dunia. Selain itu beliau juga aktif menjadi narasumber diberbagai media baik elektronik maupun cetak.</p><h3><strong>Siapa yang dapat mengikuti program</strong><br><strong>sertifikasi RTA ?</strong></h3><ol><li>Background Ekonomi</li><li>Non Background Ekonomi</li><li>No Working experience</li><li>Melengkapi skill sebagai investor/Trader</li><li>Mereka yang ingin berkarir di pasar modal ataupun industri jasa keuangan</li><li>Mereka yang ingin memperdalam pengetahuan tentang Analisa teknikal</li><li>Mereka yang ingin menentukan strategi dalam berinvestasi</li><li>Mereka yang ingin berinvestasi atau trading</li></ol><p><strong>Fasilitas Pelatihan</strong></p><ol><li>Akses 36 viveo pembelajaran selama 1 bulan</li><li>Bahan nateri pendukung pembelajaran</li><li>Pengajar profesional dibidang Analik Teknikal</li><li>Try Out (online)</li><li>Persiapan Uji Kompetensi via Zoom (mentoring)</li><li>Recording</li><li>E-Certificate</li><li>Uji kompetensi sertifikasi RTA</li><li>Sertifikat BNSP &amp; Gelar Profesi RTA (jika sudah lulus &amp; dinyatakan kompeten)</li></ol><p><strong>Jadwal Pelatihan RTA :</strong></p><ol><li>Akses Pembelajaran : 30 Juni - 30 Juli 2022</li><li>Try Out 1 : 09 - 10 Juli 2022</li><li>Try Out 2 : 16 - 17 Juli 2022</li><li>Mentoring : 23 Juli 2022</li><li>Uji kompetensi : 30 Juli 2022</li></ol><p>Syarat &amp; Ketentuan</p><ol><li>Minimal pendidikan Diploma 3 (tiga) fakultas ekonomi dengan kurikulum pasar modal, atau;</li><li>Memiliki sertifikat pelatihan Regular Techninal Analyst (RTA) bidang pasar modal yang berbasis kompetensi<br>dan diterbitkan oleh asosiasi profesi terkait, atau;</li><li>Memiliki pengalaman kerja sejenis pada industri keuangan selama 2 (dua) tahun dalam 2 (dua) tahun terakhir.</li></ol><p><strong>Info lebih lanjut hubungi</strong></p><p>0856-5742-0418 (halo sertifikasiku)</p><ul><li>Tersedia fasilitas cicilan bunga 0%</li><li>Tersedia kelas in-house training untuk perusahaan, perguruan tinggi dan instansi pemerintahan</li></ul>','offline','<p>Jl. Rini 125-6, RT.6/RW.2, Ragunan, Kec. Ps. Minggu, Kota Jakarta Selatan, Daerah Khusus Ibukota Jakarta 12540</p>','DKI Jakarta','Jakarta Selatan','2022-06-30','2022-07-01','09:00:00','16:00:00',1,'Stage and Session','https://instagram.com/sertifikasiku','https://twitter.com','http://sertifikasiku.com',0,'2022-06-21 11:29:51','2022-08-18 16:54:04',NULL,0,'CE1HXJcFQ7166081644118-Aug-2022'),(10,6,'studyjam-web3-for-frontend-developer16-09-22_16:03:10_166','StudyJam Web3 for Frontend Developer','Seminar & Talkshow','Workshop','perusahaan Digital Talent Builder Workshop IT','GATF_WEB BANNER AGENDA KOTA 2.jpg','<p>StudyJam Web3 for Frontend Developer Batch-1 adalah event StudyJam keempat NestAcademy untuk peserta umum. Konsep acara ini berbentuk bootcamp intensif yang akan diselanggarakan dalam kurun waktu kurang-lebih 1 bulan dengan total 8x pertemuan (full online).</p><p>Dibimbing langsung oleh mentor professional dari perusahaan teknologi ternama, StudyJam kali ini diharapkan dapat mencetak talent professional yang mampu menguasai framework bidang Web3 Development.</p><p><strong>KURIKULUM</strong></p><ul><li>Materi Berstandar Industri</li><li>100% Praktek</li><li>Dibimbing mentor profesional dari Industri</li></ul><p><strong>BENEFIT</strong></p><ul><li>Mendapatkan Sertifikat</li><li>Mendapatkan Video Recording Materi</li></ul><p><strong>REQUIREMENT</strong></p><ul><li>Install Truffle/Hardhat</li><li>Basic Frontend  Dev Skill</li></ul><p><strong>GUNAKAN KODE PROMO : </strong>NESTACADEMY50 untuk mendapatkan <strong>POTONGAN 50%</strong><br><strong>DAFTAR SEBELUM </strong>18 JUNI 2022<br>&nbsp;</p><p>Syarat &amp; Ketentuan</p><ul><li>Peserta yang berasal dari berbagai latar belakang diperkenankan mendaftar</li><li>Dana yang sudah dibayarkan tidak dapat ditarik kembali</li></ul><p>Label</p><ul><li>web3</li><li>dapp</li><li>front-end</li><li>bootcamp</li></ul>','online','-','Jawa Timur','Malang','2022-10-20','2022-10-20','16:20:00','16:50:00',1,'Stage and Session Stage and Session',NULL,'https://www.Twitter.com/faizatulaisyah','https://www.loket.com/o/nestacademy',0,'2022-06-30 14:33:50','2022-10-20 16:31:31',NULL,0,'2NOYZcjR3w166331376116-Sep-2022'),(11,5,'wengi','WENGI','Show & Performance','Show & Festival',NULL,'poster wengi.png','<p><strong>Wengi </strong>merupakan sebuah wahana di mana penonton dapat merasakan apa yang dialami seorang psychic light trance medium melalui virtual reality experience. Event ini menantang keberanian penonton serta memberikan pengalaman yang tak terlupakan.<br>Tujuan dari wahana ini tidak lain hanya untuk menghibur dan memberikan gambaran bahwa di dalam kegelapan pasti selalu ada cahaya.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p><p>Syarat &amp; Ketentuan:</p><p><strong>Tiket Reguler :</strong></p><p>Tanggal dan Jam yang sudah dibeli tidak dapat di reschedule</p><p>Diharuskan untuk datang 30 Menit sebelum jam Sesi yang dipilih</p><p>Tiket dianggap hangus jika datang terlambat dari jam Sesi yang tertera pada tiket</p><p>Satu tiket hanya berlaku untuk 1x masuk Wahana WENGI dengan 1 Storyline</p><p>Saat registrasi harus menunjukkan tiket dalam bentuk softcopy / hardcopy</p><p>Diharapkan membawa Handphone (Android Seri 8.0 atau IOS 11) &amp; Headphone pribadi untuk menjaga protokol kesehatan</p><p>Pengunjung menanggung risiko sendiri jika pembelian tiket dilakukan di luar dari ticketing partner resmi wahana Wengi.</p><p><strong>Tiket Bundling :</strong></p><p>Satu tiket Bundling hanya berlaku untuk 1 orang dengan 4 Storyline</p><p>Tanggal dan Jam kedatangan harap konfirmasi ke admin WENGI 10 Hari sebelum tanggal kedatangan&nbsp;</p>','offline','<p>Senayan Park, DKI Jakarta</p>','DKI Jakarta','Jakarta Selatan','2022-07-01','2022-07-24','12:00:00','20:00:00',0,'Stage and Session Sponsors Exihibitors Media Partner Stage and Session','https://www.instagram.com/wengi.id/','https://twitter.com/SaraWijayanto','https://wengi.id/',1,'2022-06-30 14:53:25','2022-08-14 20:49:01',NULL,0,NULL),(12,5,'workshop-tipis-tipis-rispek-angkatan-3','Workshop Tipis-Tipis Rispek Angkatan 3','Workshop','Workshop',NULL,'poseter hybrid.jpg','<p><strong>PENERIMAAN MURID BARU PECAHKAN</strong><br><strong>WORKSHOP TIPISTIPISRISPEK ANGKATAN 3 SUDAH DIBUKA!</strong></p><p>Comika Pecahkan menggelar kembali workshop untuk membantu kamu belajar stand-up comedy dan membuat joke dari nol,<br>Special untuk kali ini, tersedia juga kelas lanjutan dengan materi lebih umum yang bisa menambah skill dalam dunia profesionalmu!</p><p><strong>Akan dilaksanakan secara hybrid</strong>, live dari Markas Comika (Jakarta Selatan) dan online pada bulan Juli 2022 mendatang.</p><p>Workshop ini terdiri dari 5 pertemuan:</p><p><strong>KELAS PEMULA</strong></p><p>• Sabtu, 2 Juli 2022 pukul 10.00 - 15.00 WIB (2 sesi)<br>Setup &amp; Punchline Pertama bersama <i><strong>Dany Beler&nbsp;</strong></i></p><p>• Jumat, 8 Juli 2022 pukul 19.00 - 21.00 WIB<br>Melatih Delivery bersama <i><strong>Awwe</strong></i></p><p><strong>KELAS LANJUTAN</strong></p><p>• Jumat, 15 Juli 2022 pukul 19.00 - 21.00 WIB<br>Storytelling Komedik bersama <i><strong>Pandji Pragiwaksono</strong></i> (Online dari New York) &amp; <i><strong>Ulwan Fakhri</strong></i> (Live dari Markas Comika)</p><p>• Sabtu, 23 Juli pukul 15.00 - 17.00<br>Menyelipkan Komedi saat Persentasi bersama <i><strong>Ridwan Remin</strong></i></p><p>• Sabtu, 30 Juli pukul 15.00 - 17.00 WIB<br>MC Lucu bikin Acara Seru bersama <i><strong>Ridwan Remin</strong></i></p><p>Calon murid bisa memilih kategori kelas sebagai berikut:<br>▪︎ Kelas Pemula (Online) - Rp 449.000<br>▪︎ Kelas Pemula (Offline) - Rp 549.000</p><p><br>▪︎ Kelas Lanjutan (Online) - Rp 649.000<br>▪︎ Kelas Lanjutan (Offline) - Rp 700.000</p><p><br>▪︎ Kelas Pemula - Lanjutan (Online) - Rp 849.000 <i>TERBATAS!</i><br>▪︎ Kelas Pemula - Lanjutan (Offline) - Rp 949.000 <i>TERBATAS!</i></p><p><strong>Selain mendapatkan materi, kamu juga akan mendapatkan:</strong><br>• 3 sesi untuk kelas pemula dan 3 sesi untuk kelas lanjutan<br>• Rekaman Eksklusif Workshop yang dapat diakses selama 7 hari<br>• Interaksi dan praktik bersama para Pengajar Pecahkan<br>• Mencoba materi langsung di panggung Openhouse di Markas Comika<br>• Free Digital Download terpilih di comika.id yang dapat kamu pilih sendiri<br>• Sertifikat kelulusan yang akan dibagikan pada saat seremonial graduation di akhir acara</p><p><strong>KUOTA TERBATAS</strong> karena Workshop ini eksklusif!</p><p>Syarat &amp; Ketentuan</p><p>*Harga tiket yang tercantum belum termasuk biaya administrasi.</p><p>Bagi Murid Offline, wajib vaksin 2 kali dan scan PeduliLindungi di pintu masuk.</p><p>Bagi Murid Online, pastikan sudah mempunyai akun Zoom dan nama pengguna akun Zoom yang akan digunakan untuk mengikuti Workshop #TipisTipisRispek Angkatan 4 harus sama dengan Nama Lengkap yang didaftarkan saat membeli tiket.&nbsp;</p><p>Segera daftarkan dirimu melalui pecahkan.com dan cek berkala Instagram Pecahkan, serta email-mu setelah mendaftar untuk memastikan informasi seputar Workshop #TipisTipisRispek Angkatan 3.</p>','hybrid','<p>Markas Comika&nbsp;</p>','DKI Jakarta','Jakarta Selatan','2022-07-02','2022-07-30','10:00:00','21:00:00',0,'Stage and Session Stage and Session','https://www.instagram.com/comika.pecahkan/','https://twitter.com/comika_id','http://pecahkan.com/',1,'2022-07-01 12:54:49','2022-08-26 10:56:51',NULL,0,NULL),(13,6,'k-pop-dance-cover-competition','K-POP DANCE COVER COMPETITION','Show & Performance','Competition','K-POP DANCE','WhatsApp Image 2022-07-01 at 11.34.27.png','<p>Event Kpop Dance Cover Part 1<br>Present by REALITY OFFICIAL<br>Prepare your team !</p><p>Syarat &amp; Ketentuan</p><p>Jika tiket hilang maka menjadi tanggungjawab sendiri</p>','hybrid','<p><a href=\"https://www.google.com/maps/search/?api=1&amp;query=-2.2321,113.908\">UPT Taman Budaya Palangka Raya</a></p>','Kalimantan Tengah','Palangka Raya','2022-07-15','2022-07-15','13:00:00','21:00:00',1,'Stage and Session','https://www.instagram.com/_reality.ofc/','https://www.Twitter.com/faizatulaisyah','https://www