ESS CONCEPT 2022 (IFBC 2022) adalah kegiatan pameran waralaba, bisnis, peluang usaha, bisnis, distributor &amp; keagenan nasional terkini yang dilaksanakan secara terjadwal setiap tahunnya. IFBC merupakan agenda nasional dari Asosiasi Franchise Indonesia dan PT Neo Expo Promosindo sejak tahun 2005 dan rangkaian beberapa kota sejak 2007.&nbsp;</p><p>Mengusung tema “Ready, Get Set Grow” dengan semangat The Great Rebound, IFBC 2022 akan hadir di 4 kota besar di Indonesia; Tangerang, Semarang, Surabaya dan Jakarta. Kegiatan ini menghadirkan kesempatan bagi masyarakat untuk menjadi pengusaha dengan memilih ragam referensi peluang bisnis (franchise, peluang usaha, investasi, distributor, keagenan atau kemitraan), menghubungkan peluang, pengusaha, dan investor yang menjanjikan. Ditargetkan akan dihadiri oleh 50.000 pengunjung di seluruh Indonesia, dan didukung dengan ekosistem digital, IFBC 2022 dapat menjadi platform yang bagus dan efektif untuk ekspansi bisnis Anda.</p><p>Pameran IFBC 2022 kali ini berlokasi di Semarang tepatnya di UTC Convention Hotel, Semarang pada 22 Juli 2022 - 24 Juli 2022, pameran di buka pukul 10.00 - 19.00 WIB</p><p>&nbsp;</p><p>Syarat &amp; Ketentuan</p><p><strong>Informasi Penting untuk Pengunjung :</strong></p><ol><li>Memiliki aplikasi peduli lindungi.</li><li>Vaksinasi minimal 2 kali.</li><li>Anak di bawah umur 15 tahun wajib didampingi orang dewasa.</li><li>Menggunakan masker dan menjaga protocol kesehatan.</li><li>Suhu badan maksimal 37,3 derajat celcius.</li><li>Tiket yang sudah diterima tidak bisa dipindah tangankan.</li><li>Kami tidak bertanggung jawab atas kehilangan e-tiket ini.</li><li>Dilarang membawa senjata tajam, obat-obatan.</li><li>Penyelenggara berhak untuk tidak memberikan izin untuk masuk ke dalam tempat acara apabila syarat-syarat &amp; ketentuan tidak dipenuhi.</li></ol><p>Label</p><ul><li>franchise</li><li>waralaba</li><li>peluangusaha</li><li>ifbc2022</li><li>kemitraan</li></ul>','offline','<p>XCW2+MQ9 Petompon, Kota Semarang, Jawa Tengah</p>','Jawa Tengah','Semarang','2022-07-22','2022-07-24','10:00:00','19:00:00',1,'Stage and Session','https://www.instagram.com/infofranchiseexpo/','https://twitter.com/neoexpo','https://www.ttbeach.club',0,'2022-07-04 11:24:19','2022-07-04 11:49:24',NULL,0,NULL),(17,6,'ina-mhpec-2022','INA-MHPEC 2022','Conference','Conference',NULL,'WhatsApp Image 2022-07-04 at 11.57.24.png','<p>INA-MHPE Conference 2022 held by the Department of Medical, Health Professions Education, and Bioethics, Faculty of Medicine, Public Health and Nursing&nbsp;<strong>Universitas Gadjah Mada</strong>&nbsp;(UGM), in co-operation with Department of Medical Education&nbsp;<strong>Universitas Indonesia</strong>&nbsp;(UI) and Medical Education Unit, Faculty of Medicine&nbsp;<strong>Universitas Airlangga</strong>&nbsp;(UA). We invite leaders and educators in Indonesia and overseas to join the international congress focusing on&nbsp;<strong>“Towards the New Normal Era: Character Building and Competence Development in Medical and Health Professions Education”</strong>. This is an opportunity for leaders, educators and those who have the same vision, to connect and collaborate, to learn an update for a better health care professions education.</p><p>Indonesian Medical and Health professions Education conference (INA - MHPEC) is proposed to be an annual congress, stems from an idea to collaborate with several national reputable universities that have strong commitment to enhance medical education area and those who have department or unit of medical education in their faculty. We agreed to hold an integrated scientific forum in medical education and health professions; in conjunction with Previous&nbsp;<strong>JAKMED</strong>&nbsp;(Jakarta Meeting on Medical Education) held by Faculty of Medicine Universitas Indonesia,&nbsp;<strong>JIT</strong>&nbsp;(Jogja Rendezvous for Transformation and Innovation in Medical Education) held by Faculty of Medicine Universitas Gadjah Mada, and&nbsp;<strong>SUME</strong>&nbsp;(Surabaya Update on Medical Education) held by Faculty of Medicine, Universitas Airlangga, and also annual scientific meeting of professional organizations of&nbsp;<strong>PERPIPKI</strong>&nbsp;(Perhimpunan Pengkaji Ilmu Pendidikan Kedokteran Indonesia),&nbsp;<strong>AIPKI</strong>&nbsp;(Asosiasi Institusi Pendidikan Kedokteran Indonesia),&nbsp;<strong>IAMHPE</strong>&nbsp;(Indonesian College of Health Professions Education),&nbsp;<strong>AIDIPROKESI</strong>&nbsp;(Asosiasi Ahli Pendidikan Profesi Kesehatan Indonesia).</p><p>&nbsp;</p><p>The 2022 INA MHPEC is in conjunction with the 13th JAKMED the 4th JIT, the 5th SUME, PERPIPKI scientific meeting, AIPKI scientific meeting, 2nd IAM HPE scientific meeting, and AIDIPROKESI scientific meeting. The 2022 INA-MHPEC also supported by the JCOEMPH (Journal of Community Empowerment for Health).</p><p>&nbsp;</p><p>Please visit the <a href=\"https://mhpeconference.fk.ugm.ac.id/\">Conference Website&nbsp; (https://mhpeconference.fk.ugm.ac.id) </a>for further information.</p><p>&nbsp;</p><p>Seats availability are subject to change. Attendee at the conference venue limited to 50 participants.</p><p>&nbsp;</p><p>Label</p><ul><li>konferensi</li><li>INAMHPEC</li><li>UGM</li><li>Unair</li><li>UnivIndonesia</li></ul>','offline','<p>69JF+HWX, Joglo Grha Alumni, JL. Farmako, Fakultas Kedokteran UGM, Senolowo, Sinduadi, Kec. Mlati, Kabupaten Sleman, Daerah Istimewa Yogyakarta 55281</p>','DI Yogyakarta','Sleman','2022-07-03','2022-07-06','08:00:00','20:00:00',1,'Stage and Session','https://www.instagram.com/inamhpec/','https://www.twitter.com/inamhpec/','https://explore.agendakota.id/',0,'2022-07-04 12:03:52','2022-07-05 11:14:50',NULL,0,NULL),(18,5,'explore-ujung-kulon-trip-every-weekend','Explore Ujung Kulon (Trip Every Weekend)','Accommodation','Attraction',NULL,'ujung kulon.jpg','<p>Trip every weekend</p><p>1. Start Plaza Semanggi Jakarta/Kebon Jeruk/ Slipi /Res Area Karang Tengah Km 14 725.000/ Pax</p><p>2.Start Serang Indomaret Patu7ng kemang/ Indomaret Ciceri Dkt carefour/ Palima &nbsp;675.000/ Pax dan Pandeglang di Alun2nya..</p><p>3.Start Sumur Dadap Langu 550.000/ Pax</p><p>Destinasi:<br>- Pulau Peucang<br>- Treking Pohon Kiara ( Arah menuju Karang Copong)<br>- Snorkeling Ciapus &amp; Suminoh<br>- Cidaon (Savana Banteng &amp; Hunting Sunset)<br>- Sungai Cigenter (Canoing)<br>- Pulau Badul</p><p>INCLUDING (Termasuk)<br>- Makan 5x<br>1. Sarapan Nasi Uduk<br>2. Makan siang ayamgoreng<br>3. Makan makan malam ikan bakar<br>4. Sarapan nasi goreng<br>5. Makan siang ikan goreng<br>- Transport Darat Ac Dari Semanggi-Sumur (PP)<br>- Kapal Wisata<br>- Air mineral selama Trip<br>- Pelampung&nbsp;<br>- Penginapan di Pulau Peucang ( Barak)<br>- Guide Lokal<br>- Dokumentasi Underwater &amp; Camera Slr<br>- Drone ( Tentatif)<br>- Asuransi TNUK<br>- Semua tiket wisata<br>- Restribusi wisata<br>- Goreng Pisang<br>- Buah Semangka&nbsp;</p><p>Excluding (Blm termasuk)<br>- Canoing (50.000/Orang)<br>- Alat snorkeling (50.000 /Orang)<br>- Alat Snorkeling+ Sepatu Katak ( 80.000/Orang)<br>- Tips Abk &amp; guide seikhlasnya&nbsp;<br>Itinerary :</p><p>Day 01</p><p>20.00 - 20.30 meeting point Plaza semanggi/daerah sekitaran Jakarta<br>20.30- 04.00 sampai di Sumur Dadap Langu (istirahat)</p><p>Day 02.00</p><p>05.00-08.30 Perjalanan menuju pulau peucang (Sarapan Di Kapal)<br>09.00 Chek In Penginapan&nbsp;<br>&nbsp;09.30 -10.30 &nbsp;Acara santai main pantai pulau peucang.<br>11.00 -12.00 Menuju Pohon kiara ( Treking)<br>12.30 - 13.30 Makan siang&nbsp;<br>14.00- 16.00 Snorkeling Ciapus, Suminoh&nbsp;<br>16.30 - 17.30 Cidaon/padang Savana &amp; hunting sunset<br>18.00 menuju Penginapan di Peucang<br>20.00 Makan Malam<br>21.00 Goreng Pisang &amp; Teh manis&nbsp;<br>22.00 &nbsp;Istirahat</p><p>Day 03&nbsp;<br>05.00-06.00 sunrise di dermaga&nbsp;<br>07.00 Sarapan<br>09.00 Chek Out Menuju Tempat &nbsp;Canoing Sungai Cigenter<br>10.30 - 12.00 Canoing Cigenter<br>12.00 - 12.30 Menuju Pulau Badul<br>12.30. -13.30 Makan siang di Pulau Badul<br>13.00 - 14.00 Menuju parkiran&nbsp;<br>14.30 bersih-bersih Parkiran Sumur (Dadap Langu)<br>15.30 menuju Jakarta<br>23.00 Sampai ke Jakarta ( Plaza Semanggi)</p><p>&nbsp;</p><p>Fasilitas penginapan open trip barak 8-10 Orang/Kamar laki2 dan perempuan di pisah.<br>Jika penginpan tidak mau di gabung sama peserta lain bisa upgred ke3 penginapan:<br>&nbsp;<br>*Fauna 400/Kamar untuk 3-4 Orang<br>*Fauna 700/Kamar untuk 2 - 3 Orang<br>*Vila Batik 1.800 untuk 2-3 Orang &nbsp; &nbsp;<br>&nbsp;</p><p>Info</p><p>Whatsapp 0838-0753-8116</p><p>Instagram @loha_adventure</p>','offline','<p>Pulau Peucang</p>','Banten','Pandeglang','2022-10-01','2022-11-30','19:00:00','21:00:00',0,'KOSONG','https://www.instagram.com/loh_adventure/',NULL,NULL,1,'2022-07-04 12:08:05','2022-08-26 10:55:16',NULL,0,NULL),(19,6,'partyafterpandemic','PARTYAFTERPANDEMIC','Meet-up& Gathering','Summit',NULL,'WhatsApp Image 2022-07-04 at 13.44.09.png','<p>A PARTY EXPERIENCE BY RUMAH HIJAU GROUP</p><p>&nbsp;</p><p><strong>PARTY AFTER PANDEMIC</strong></p><p>16/07/22</p><p>Villa puncak bogor</p><p>&nbsp;</p><p>DJ Performance :</p><ul><li>RAVANELL JUNKIES</li><li>IMAN AP</li><li>ISSAYA ER</li></ul><p>&nbsp;</p><p>Support by</p><ul><li>PSYCHOPATIC ATTACK</li><li>® Legionnaire™ x JustNoob™</li><li>TRASHIE</li><li>IMMORTALITY</li><li>FELLOW</li><li>PASUKAN TUBRUK</li></ul><p>&nbsp;</p><p>TICKET PRICE</p><ul><li>EARLY BIRD 150.000 (1 Ticket include food&amp;drink and barbeque)</li><li>COUPLE 400.000 (2 Ticket include food&amp;drink, tent, snack and barbeque)</li><li>OTS 180.000 (1 Ticket include food&amp;drink and barbeque)</li></ul><p>&nbsp;</p><p>RSVP and Info</p><ul><li>Line: teddy.sptr</li><li>Wa: 089525805684</li></ul><p>&nbsp;</p><p>IG: @rumahijau_</p><p>Design partner @zndesigngraphic</p><p>Syarat &amp; Ketentuan</p><ul><li>Early bird and couple ticket payment must be done before 9 july 2022</li></ul><p>Label</p><ul><li>PARTYAFTERPANDEMIC</li><li>Rumahijau</li><li>Pap</li></ul>','offline','<p>-</p>','Jawa Barat','Bogor','2022-07-16','2022-07-16','07:00:00','23:55:00',1,'Stage and Session','https://www.instagram.com/Rumahijau_/','https://www.twitter.com/Rumahijau_/',NULL,0,'2022-07-04 13:55:07','2022-07-06 13:53:03',NULL,0,NULL),(20,5,'de-majestic-nightmare-tour','De Majestic Nightmare Tour','Atraction & Themepark','Attraction',NULL,'de majestic.jpg','<p>De Majestic Nightmare Tour adalah sebuah experiance menyaksikan live act dengan cerita horor urband legend bandung dan menikmati perjalanan night city tour</p><p>Syarat &amp; Ketentuan</p><ol><li>Tiket dapat ditukar di lokasi sesuai tanggal dan jam yang di pesan.</li><li>Tunjukan E-ticket yang dikirim via email kepada petugas tiket untuk melakukan scan QR code yang tertera di e-ticket.</li><li>Setelah berhasil scan QR code, kostumer akan mendapatkan tiket masuk untuk masuk kedalam gedung.<br>Kustomer wajib menggunakan masker dan handsanitizer.<br><br>&nbsp;</li></ol><p>(Penukaran tiket bisa dilakukan di venue sesuai dengan tanggal dan jam yang telah dipesan. Apabila datang tidak sesuai dengan tanggal dan jam yang dipesan maka tiket tidak berlaku.<br>Harap datang sebelum memasuki sesi selanjutnya)</p><p>Informasi Umum</p><ol><li>Usia minimum 13 tahun.</li><li>Wajib datang sesuai tanggal dan jam yang sudah ditentukan. Apabila datang tidak sesuai dengan tanggal dan jam<br>yang sudah ditentukan tiket tidak berlaku.</li><li>Tiket yang sudah dibeli tidak bisa di refund.</li><li>Periksa kembali tiket yang di pilih, dengan tanggal dan waktu pada sesi yang sesuai.</li><li>Dilarang membawa makanan dan minuman ke dalam wahana serta dilarang membawa senjata tajam.</li><li>Dilarang merekam atau mengambil gambar selama didalam wahana.</li><li>Tidak diperuntukkan bagi pengunjung ibu hamil atau yang memiliki penyakit asma, jantung dan epilepsi.</li><li>Dilarang merusak atau mengambil properti di dalam gedung.</li><li>Wajib menjaga protokol kesehatan seperti memakai masker dan menggunakan hand santizer.</li></ol>','offline','<p>De Majestic</p>','Jawa Barat','Bandung','2022-06-30','2022-07-29','19:00:00','22:00:00',0,'KOSONG','https://www.instagram.com/demajestic_bandung/',NULL,NULL,1,'2022-07-04 14:23:08','2022-08-26 10:55:10',NULL,0,NULL),(21,6,'ngopi-raihkarirmu','NGOPI #RaihKarirmu','Workshop','Workshop',NULL,'WhatsApp Image 2022-07-04 at 14.19.01.png','<p>CV mu ingin direview?</p><p>Belum mantap ingin berkarir dimana?</p><p>Mau tahu lebih banyak prospek perusahaan start-up?</p><p>Apa plus minusnya menjadi Pegawai Negeri?</p><p>Apapun pertanyaanmu seputar karir dan dunia kerja, akan kita bahas langsung interaktif bersama-sama</p><p>Yuk ikuti NGOPI dari Dilantern, NGObrol sePutar karIr, bersama Pakar Praktisi di bidangnya</p><p>Senin 04 Juli 2022 Pkl 18.00 – 20.00 WIB</p><p>#RaihKarirmu. Jalin komunitas pertemanan baru. Dapatkan ilmu bermanfaat.&nbsp;</p><p>Daftar segera karena kuota peserta terbatas!</p><p>Syarat &amp; Ketentuan</p><p><strong>Link Live Zoom</strong>&nbsp;akan diinformasikan pada&nbsp;<strong>e-ticket (WatchHere)&nbsp;</strong>dalam email yang dikirimkan oleh Loket.com setelah proses pembelian tiket berhasil dilakukan</p><p>Label</p><ul><li>karir&nbsp;</li><li>sukses</li></ul>','online','-','DKI Jakarta','Jakarta Selatan','2022-07-04','2022-07-04','18:00:00','21:00:00',1,'Stage and Session','https://www.instagram.com/dilantern_/',NULL,NULL,0,'2022-07-04 14:28:15','2022-07-04 14:37:34',NULL,0,NULL),(22,6,'launching-perdana-series-sci-fi-comic-book-of-volter-stein','Launching Perdana Series Sci-fi Comic Book of VOLTER STEIN','Exhibition','Exhibition',NULL,'WhatsApp Image 2022-07-04 at 15.14.03.png','<p><strong>Acara Virtual didukung oleh:</strong></p><ul><li>Anindosta Network</li><li>IN Youtube Channel</li><li>Astra Startup Community</li><li>Kemendikbud RI</li><li>Universitas Djuanda Bogor</li></ul><p>Syarat &amp; Ketentuan</p><ol><li>Pastikan Anda melakukan registrasi dengan data diri yang jelas dan sesuai, saat melakukan pembelian tiket serta saat mengikuti sesi launching.</li><li>Peserta akan mendapatkan link Youtube melalui email yang akan dikirimkan secara otomatis oleh email Loket.com</li><li>E-Ticket yang sudah dipesan tidak dapat dibatalkan dan atau dialihkan dengan cara apapun kepada orang lain dengan alasan apapun.</li><li>Dengan mendaftarkan diri dan mendapatkan e-ticket tersebut, peserta dianggap mengerti &amp; menyetujui syarat dan ketentuan yang berlaku.</li><li>Pihak Anindosta Studios berhak melakukan tindakan yang diperlukan apabila diduga ada kecurangan.</li><li>Pastikan Anda selalu mengecek tanggal dan waktu penayangan acara pada link Youtube Live karena waktu dan tanggal acara dapat berubah sewaktu-waktu.</li><li>Peserta yang mendapatkan E-Sertifikat yaitu peserta yang mendaftar pada Loket.com atau Eventbrite.com dan mengisi absen pada chat line di kanal Youtube.</li><li>Silakan persiapkan pertanyaan terbaik kamu untuk ditanyakan pada saat sesi talkshow dan 3 pertanyaan terbaik akan mendapatkan paket eksklusif Volter Stein\'s dengan syarat dan ketentuan berlaku. Harap mencantumkan nama dan akun Instagram agar memudahkan panitia untuk menghubungi jika terpilih.</li><li>Harap tidak menggunakan kata-kata yang berbau SARA dan pornografi di dalam live chat.</li><li>Dengan membeli tiket&nbsp;ini, Anda telah menyetujui pengumpulan, penyimpanan, dan penggunaan data Anda untuk keperluan acara dan sponsor.</li><li>Penyelenggara berhak untuk tidak memberikan izin untuk mengikuti sesi webinar apabila syarat-syarat &amp; ketentuan tidak dipenuhi.</li></ol><p>Label</p><ul><li>komik&nbsp;</li><li>buku&nbsp;</li><li>fiksi&nbsp;</li><li>launching&nbsp;</li><li>volterstein</li></ul>','online','-','Jawa Barat','Bogor','2022-07-20','2022-07-20','13:00:00','15:00:00',1,'Stage and Session','https://www.instagram.com/anindosta_studios/','https://twitter.com/AnindostaStudio','https://www.loket.com/o/AnindostaStudios',0,'2022-07-04 15:18:19','2022-07-04 15:25:05',NULL,0,NULL),(23,5,'promosi-branding-sosial-media','Promosi & Branding Sosial Media','Accommodation','Attraction',NULL,'promosi medsos.jpg','<p><strong>PROMOSI</strong>&nbsp;adalah suatu hal penting dalam menyelenggarakan event atau kegiatan. Keberhasilan sebuah kegiatan diawali dari bagaimana ia mempromosikannya.</p><p><i><strong>Webinar Parenting</strong></i>&nbsp;berkolaburasi dengan&nbsp;<i><strong>Liburan Positif</strong></i>&nbsp;dan<i>&nbsp;<strong>Design Ku</strong></i>&nbsp;untuk memfasilitasi para penyelenggara acara parenting atau kegiatan lainnya untuk mempromosikan kegiatan melalui berbagai channel media sosial kami dengan berbagai layanan :</p><ul><li>Design</li><li>Promosi Medsos</li><li>Personal Branding</li></ul><p>Ayo bergabung bersama kami....</p><p>Syarat &amp; Ketentuan</p><p>Event yang dipromosikan dipastikan tidak melanggar SARA</p>','online','-','DKI Jakarta','Jakarta Pusat','2022-05-17','2022-07-30','19:00:00','22:00:00',0,'KOSONG','https://www.instagram.com/liburanpositif/',NULL,NULL,1,'2022-07-04 15:25:38','2022-08-26 10:54:56',NULL,0,NULL),(24,6,'si-intro-5-how-to-choose-the-right-programmes-university','SI Intro 5: How to Choose The Right Programmes & University','Conference','Conference',NULL,'WhatsApp Image 2022-07-04 at 15.27.29.png','<p>Hi TransforMers!</p><p>Setelah kamu memilih beasiswa yang kamu inginkan, ternyata kamu perlu memilih jurusan dan universitas yang tepat juga. Karena ngga sedikit orang yang gagal menyelesaikan studinya di luar negeri akibat salah memilih jurusan ataupun universitas, lho!</p><p>Nah, pas banget TransforMe kembali menghadirkan webinar untuk membantu kamu dengan tema \"<strong>SI Intro 5: How to Choose The Right Programmes &amp; University</strong>\" yang akan dilaksanakan pada:</p><p><strong>Hari/Tanggal : Sabtu, 13 Agustus 2022</strong><br><strong>Waktu &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : 11.00-13.00 WIB</strong><br><strong>Pembicara</strong><br><strong>• Maryam Qonita</strong><br><strong>New York University (LPDP Awardee)</strong></p><p>&nbsp;</p><p><strong>Kamu akan mengetahui:</strong></p><ul><li>Tips &amp; Trick memilih jurusan dan universitas yang sesuai dengan karakter, visi, dan misi.</li><li>Mendapatkan insights &amp; konsultasi langsung kepada pembicara terkait bagaimana membangun koneksi yang kuat dalam mendukung proses beasiswa</li></ul><p><strong>Kenapa Workshop TransforMe?</strong></p><ul><li>Materi dari pembicara yang sudah pasti \"daging\" semua</li><li>Bisa berdiskusi dengan speakers langsung &amp; berkesempatan menjalin relasi dengan pembicara yang berasal dari kalangan profesional lainnya</li><li>Rekaman sesi acara dan materi yang bisa kamu akses kembali</li></ul><p>Syarat &amp; Ketentuan</p><ol><li>Link zoom dapat diakses melalui email verifikasi loket dibagian \"Watch Here\"</li><li>Zoom room akan dibuka 10 menit sebelum acara dimulai.</li><li>Rekaman video untuk sesi acara akan dikirimkan setelah peserta mengisi satisfaction survey melalui link yang akan dibagikan pada akhir acara nantinya melalui alamat email masing-masing.</li><li>E-Ticket hanya berlaku untuk 1 (satu) orang dan 1 (satu) kali penggunaan sesuai dengan waktu &amp; tanggal event.</li><li>Selama acara, akan ada kesempatan peserta untuk bertanya pada kolom chat dan/atau berdiskusi langsung dengan pembicara setelah diizinkan oleh moderator.</li><li>Peserta dilarang merekam secara personal keseluruhan sesi yang berlangsung.</li><li>Siapkan semangat terbaik dan enjoy it ya!</li></ol><p><strong>Hubungi Narahubung pada 082311688676 Jika ada kendala atau pertanyaan</strong></p><p>Label</p><ul><li>scholarship</li><li>beasiswaluarnegeri</li><li>webinarbeasiswa</li><li>Scholarship2022</li><li>mentoringbeasiswa</li></ul>','online','-','DKI Jakarta','Jakarta Barat','2022-07-10','2022-07-10','11:00:00','13:00:00',1,'Stage and Session','https://www.instagram.com/transforme.id/',NULL,NULL,0,'2022-07-04 15:31:23','2022-07-14 14:07:09',NULL,0,NULL),(25,6,'ruang-pamer-metaverse24-08-22_16:15:16_156','RUANG PAMER METAVERSE','Festival & Fair','Show & Festival',NULL,'WhatsApp Image 2022-07-04 at 15.55.39.png','<p>Ruang pameran metaverse smknn padang cermin.</p><p>Syarat &amp; Ketentuan</p><ol><li>memiliki perangkat laptop dengan spesifikasi yang memadai.</li><li>memiliki akses internet yang fast dan stabil.</li></ol>','online','-','Lampung','Pesawaran','2022-07-07','2022-07-07','07:00:00','23:55:00',1,'Stage and Session','https://www.instagram.com/SMKNPadangCermin/',NULL,'https://www.loket.com/o/ibnu.masruri',0,'2022-07-04 16:01:24','2022-08-24 16:15:16',NULL,0,'h9XZCP50Qg166133236124-Aug-2022'),(26,5,'interactive-storytelling','Interactive Storytelling','Concert','Live Music & Concert',NULL,'interactive storytelling.jpg','<p>Interactive Storytelling merupakan bagian dari rangkaian kegiatan menuju Musikal Dari Rumah 3. Interactive Storytelling ingin mengajak anak-anak Indonesia untuk menikmati Hari Anak Nasional dengan hiburan yang bermakna.</p><p>Interactive Storytelling merupakan salah satu bentuk dukungan dari Aksi Cinta Indonesia terhadap anak-anak Indonesia untuk menemukan jati dirinya sebagai orang Indonesia melalui seni, salah satunya seni bermusik.</p><p>Tentang Musikal dari Rumah: Musikal Dari Rumah (MDR) merupakan inisiatif Gerakan Aksi Cinta Indonesia sehingga anak-anak dapat terlibat dalam proses produksi sebuah musikal hanya dari rumah masing-masing.</p><p>Tentang Aksi Cinta Indonesia: Aksi Cinta Indonesia (ACI) merupakan sebuah gerakan yang menjadi wadah bagi anak- anak Indonesia untuk belajar, berkolaborasi, berkarya dan berbagi. Melalui ACI, anak-anak diajak untuk menemukan kembali identitas mereka sebagai orang Indonesia melalui seni inovatif, salah satunya musik.</p><p>&nbsp;</p><p>Syarat &amp; Ketentuan</p><h2>TERMS &amp; CONDITION&nbsp;</h2><p>1. IMPORTANT - Pada tiket terdapat link menuju Grup Whatsapp dari event Interactive Storytelling by Aksi Cinta Indonesia. Melalui Grup Whatsapp tersebut, tim Aksi Cinta Indonesia x Universitas Prasetiya Mulya akan mengirimkan informasi-informasi terkait event dan link Zoom yang akan dikirim pada tanggal 20 Juli 2022 (3 hari sebelum acara dimulai).&nbsp;</p><p>Hubungi Contact Person Aksi Cinta Indonesia x Universitas Prasetiya Mulya ini jika kamu mengalami kendala: +62 87876466611 (Verdi).</p><p>2. Aksi Cinta Indonesia merupakan suatu yayasan yang menjadi wadah bagi anak-anak untuk menemukan kembali identitas mereka sebagai orang Indonesia melalui seni inovatif, terutama musik.</p><p>3. Silakan hubungi kami sesuai nomor di atas apabila kalian tidak dapat mengakses link Grup Whatsapp yang telah diberikan.&nbsp;</p><p>4. Aksi Cinta Indonesia x Universitas Prasetiya Mulya tidak akan menindaklanjuti komplain mengenai tidak dapat mengakses Grup Whatsapp / Link yang diberikan bila acara sudah selesai.</p><p>5. Jika ditemukan perbedaan nama pada saat pembelian E-Ticket dan saat masuk ke room ZOOM maka tidak dapat masuk ke dalam ruangan.</p><p>6. Peserta sudah dapat bergabung di ruang tunggu melalui akses link yang diberikan 15 menit sebelum event dimulai.</p><p>7. E-Ticket hanya berlaku untuk 1 (satu) Orang dan 1 (satu) kali penggunaan sesuai dengan waktu &amp; tanggal event.</p><p>8. E-Ticket yang sudah dipesan/dibeli dan dibayar oleh Peserta, tidak dapat dibatalkan atau dikembalikan (refund) atau diuangkan atau dijual kembali atau dialihkan dengan cara apapun kepada orang lain dengan alasan apapun.</p><p>9. Dengan membeli E-Ticket tersebut, Peserta dianggap mengerti &amp; menyetujui syarat dan ketentuan yang berlaku.</p><p>10. Aksi Cinta Indonesia x Universitas Prasetiya Mulya berhak melakukan tindakan yang diperlukan apabila diduga ada kecurangan yang merugikan.</p>','online','-','DKI Jakarta','Jakarta Pusat','2022-07-14','2022-07-14','14:00:00','16:00:00',0,'KOSONG','https://www.instagram.com/gapai.mimpimu/?hl=id',NULL,NULL,1,'2022-07-04 16:03:15','2022-08-26 10:53:59',NULL,0,NULL),(27,6,'info-session-permanent-residency-kanada24-08-22_16:04:11_156','INFO SESSION PERMANENT RESIDENCY KANADA','Seminar & Talkshow','Talkshow',NULL,'WhatsApp Image 2022-07-05 at 09.47.57.png','<p><strong>Cari informasi mengenai cara mendapatkan PR Canada ? Jangan lewatkan Info Session dengan tema ” Pindah ke Kanada Melalui Jalur Studi \" !</strong></p><h2><strong>Jangan lewatkan Info Session dengan tema ” Pindah ke Kanada Melalui Jalur Studi “&nbsp;yang akan diselenggarakan pada :</strong></h2><p>&nbsp;</p><p><strong>Hari &amp; Tanggal : Rabu, 6 Juli 2022</strong></p><p><strong>Waktu : Pukul 19.00 – 21.00 WIB</strong></p><p><strong>Lokasi : Jakarta ( Hotel TBA )</strong></p><p>&nbsp;</p><p><strong>Pembicara :</strong></p><ul><li>Ms Heather Lewis, Registered Canadian Immigration Consultant</li><li>Ms Fairlane Inso, Regional Manager Southeast Asia at Sault College</li></ul><p>Dengan mengikuti info sesi kali ini, kalian akan mendapatkan informasi penting terkait migrasi ke kanada ataupun cara mendapatkan<strong>&nbsp;permanent resident ( PR ) Canada</strong>&nbsp;melalui jalur studi. Dengan&nbsp;<strong>studi</strong>&nbsp;minimum<strong>&nbsp;2 tahun</strong>, sudah bisa apply permanent resident*(s&amp;k berlaku)</p><p>Acara ini sangat cocok untuk kalian yang ingin&nbsp;<strong>kuliah, kerja dan tinggal di Kanada</strong>, baik sendiri maupun&nbsp;<strong>membawa serta keluarga</strong>&nbsp;ke Kanada.</p><p>Topik yang akan dibahas selama acara meliputi&nbsp;<strong>Rural Northern Immigration Pilot ( RNIP )</strong>,&nbsp;<strong>Program studi di Sault College</strong>, dan juga&nbsp;<strong>support</strong>&nbsp;yang akan&nbsp;<strong>diberikan</strong>&nbsp;untuk siswa dan keluarga baik dari Sault College maupun dari komunitas lokal.</p><p>Label</p><ul><li>kuliahdikanada</li><li>kuliahluarnegeri</li><li>kuliahdiaustralia</li><li>educationexpo</li><li>pameranpendidikan</li></ul>','offline','<p><a href=\"https://www.google.com/maps/search/?api=1&amp;query=-6.18036,106.73\">Hotel Neo Puri Indah, DKI Jakarta</a></p>','DKI Jakarta','Jakarta Barat','2022-07-06','2022-07-06','19:00:00','21:00:00',1,'Stage and Session','https://www.instagram.com/optimaeducation/',NULL,'https://www.loket.com/o/lkt-d2V6',0,'2022-07-05 09:53:03','2022-08-24 16:04:12',NULL,0,'8xoiQ47swi166132983224-Aug-2022'),(28,6,'dramatic-reading-dialog-gandari-puisi-goenawan24-08-22_15:23:21_156','Dramatic Reading : Dialog Gandari Puisi Goenawan','Show & Performance','Show & Festival',NULL,'WhatsApp Image 2022-07-05 at 10.14.16.png','<p>Dialog Gandari merupakan pusis karya Goenawan Muhammad yang coba kami terjemahkan dalam bentuk pertunjukan teater. selamat menyasikan</p><p>Syarat &amp; Ketentuan</p><ol><li>Gunakan Erphone/ sambungkan dengan pengeras suara</li><li>Pastikan tempat dam kondisi tenang agar mendapatkan efek kontemplatif</li><li>Jika memungkinkn gunakan proyektor untuk mendapat sensasi menonton yang memuaskan</li></ol><p>Label</p><ul><li>teater</li><li>drama</li><li>seni</li><li>pertunjukan</li></ul>','online','-','Jawa Tengah','Banyumas','2022-07-05','2022-07-05','11:20:00','12:00:00',1,'Stage and Session','https://www.instagram.com/komunitas.kiebae/',NULL,NULL,0,'2022-07-05 11:00:48','2022-08-24 15:23:21',NULL,0,'N20yzBzOWn166132923924-Aug-2022'),(29,5,'digital-talent-gap-di-industri-blockchain','Digital Talent Gap di Industri Blockchain','Seminar & Talkshow','Talkshow',NULL,'digital talent.jpg','<p>Indonesia kekurangan 9 juta orang digital talent selama 2015 hingga 2030. Siapkah kamu menjadi digital talent selanjutnya?</p><p>Greaters, digital talent menjadi yang paling dicari di era digital ini loh. Mengingat semakin meningkatnya transformasi digital yang dilakukan oleh beberapa perusahaan, namun, masih kurangnya sumber daya manusia yang memiliki kemampuan menguasai teknologi digital. Bahkan, Presiden Jokowi mengharapkan digital talent Indonesia yang sedang berada di luar negeri untuk kembali ke Indonesia.</p><p>Digital talent sendiri dibutuhkan di berbagai bidang digital, salah satunya dalam pengembangan teknologi blockchain yang sedang ramai diperbincangkan ini nih. Menarik ya? Pas banget nih! GreatEdu berkolaborasi dengan Litedex dalam online talkshow ini untuk membahas tentang perkembangan hingga peluang blockchain di masa yang akan datang.</p><p>Cek ketersediaan kelas dan beli tiketnya ya!</p><p>Syarat &amp; Ketentuan</p><ul><li>Pembelian kelas tidak dapat dibatalkan dan/atau dialihkan ke kelas lain secara sepihak oleh Peserta.</li><li>Peserta yang berhalangan hadir wajib menginformasikan kepada Admin GreatEdu agar tetap mendapatkan soft file materi dan rekaman video kelas.</li><li>Semua pemberitahuan seputar informasi dan perubahan kelas disampaikan melalui email dan WhatsApp Official GreatEdu. Pastikan kamu mengisi data diri dengan lengkap dan benar saat registrasi.</li></ul><p><i><strong>Punya pertanyaan seputar kelas ini? Sampaikan kepada kami melalui WhatsApp Official GreatEdu di:</strong></i></p><p><i><strong>+62 816-338-441</strong></i></p>','online','-','DKI Jakarta','Jakarta Pusat','2022-07-06','2022-07-06','19:00:00','21:00:00',0,'KOSONG','https://www.instagram.com/greatedu.id/?hl=id','https://twitter.com/id_greatedu','https://twitter.com/id_greatedu',1,'2022-07-05 11:35:22','2022-08-26 10:53:59',NULL,0,NULL),(30,6,'building-your-brand-globally24-08-22_15:16:19_156','Building your brand globally','Workshop','Workshop',NULL,'Screen Shot 2022-08-24 at 15.15.22.png','<p>Is your company looking to expand business beyond Indonesia? Trying to find new investments from abroad? Or is your company looking for ways to introduce products/solution into the Indonesian market?&nbsp;How can you share your growth story to the world?&nbsp;</p><p>Come for the “<strong>Building your brand globally</strong>” seminar held by <a href=\"https://www.apac.hoffman.com/\">The Hoffman Agency</a> in Indonesia, an integrated marketing communications agency with offices around the world.</p><p>You’ll get to hear how businesses can tell their story to a global audience or vice versa, along with best practices &amp; case studies.</p><p><strong>Get FREE swag and goodies!</strong></p><p>Join us on the 7th of July (Thursday) 2022 at 10:00am-12:00pm at GoWork Event Space, Pacific Place 2nd floor, Jl. Jend. Sudirman Kav. 52-53, Jakarta Selatan 12190, Indonesia (or you can join in via Zoom as well, link will be provided upon registration)<br>============================================</p><p>Apakah perusahaan Anda ingin memperluas bisnis di luar Indonesia? Mencoba mencari investasi baru dari luar negeri? Atau apakah perusahaan Anda sedang mencari cara untuk memperkenalkan produk / solusi ke pasar Indonesia? Bagaimana Anda dapat membagikan kisah bisnis Anda kepada dunia?</p><p>Datanglah ke seminar <strong>“Membangun merek Anda secara global”</strong> yang diadakan oleh The Hoffman Agency di Indonesia, sebuah agensi komunikasi pemasaran terintegrasi dengan kantor tersebar di seluruh dunia.</p><p>Anda akan mendengar bagaimana bisnis dapat menceritakan kisah mereka kepada audiens global atau sebaliknya, bersama dengan praktik terbaik &amp; studi kasus.</p><p><strong>Dapatkan GRATIS </strong><i><strong>swag </strong></i><strong>dan hadiah!</strong></p><p>Bergabunglah bersama kami pada 7 Juli (Kamis) 2022 pukul 10:00-12:00 di GoWork Event Space, Pacific Place lantai 2, Jl. Jend. Sudirman Kav. 52-53, Jakarta Selatan 12190, Indonesia<br>(atau Anda dapat bergabung melalui Zoom, tautan akan diberikan saat mendaftar)</p><p>Syarat &amp; Ketentuan</p><ul><li>This event is open for everyone to join!<br><i>(Please note that only physical attendees will get the swag and goodies)&nbsp;</i></li><li>GoWork might require you to do online check-in and vaccine status check upon arrival</li></ul><p>Event ini terbuka untuk siapa saja!<br><i>(Harap diperhatikan bahwa swag dan hadiah hanya tersedia untuk peserta yang datang langsung ke tempat)</i></p><p>GoWork mungkin memerlukan Anda untuk check-in daring dan memeriksa status vaksinasi ketika hadir.</p><p>Label</p><ul><li>Bisnis</li><li>Business</li><li>Humas</li><li>Marketing</li><li>Communication</li></ul>','offline','<p><a href=\"https://www.google.com/maps/search/?api=1&amp;query=-6.22474,106.811\">GoWork Event Space, Pacific Place</a></p>','DKI Jakarta','Jakarta Selatan','2022-07-21','2022-07-21','10:00:00','12:00:00',1,'Stage and Session',NULL,NULL,'https://www.loket.com/o/lkt-bGlP',0,'2022-07-05 12:00:07','2022-08-24 15:16:19',NULL,0,'r1ETL9XLSb166115042322-Aug-2022'),(31,5,'senja-di-akasa-bersama-pamungkas','Senja di Akasa bersama Pamungkas','Concert','Live Music & Concert',NULL,'pamungkas.jpg','<p>Senja di Akasa bersama Pamungkas</p><p>Term &amp; Conditions :&nbsp;</p><ol><li><strong>E-voucher yang sah adalah yang dibeli melalui GoTix dan Loket.com.</strong></li><li><strong>E-voucher event Grand Opening Asha Akasa bersama Pamungkas hanya bisa digunakan saat event berlangsung yaitu 29 Juli 2022</strong></li><li><strong>Satu E-voucher berlaku untuk satu orang.</strong></li><li><strong>Semua pengunjung diwajibkan sudah melakukan vaksin COVID-19 minimum dosis 2 dan mempunyai aplikasi PeduliLindungi.</strong></li><li><strong>Penyelenggara memiliki hak untuk:</strong><ol><li><strong>Melarang masuk pengunjung jika E-voucher telah dipergunakan oleh orang lain.</strong></li><li><strong>Melarang masuk pengunjung ke area venue jika E-voucher yang digunakan tidak valid.</strong></li><li><strong>Memproses atau mengajukan hukum, baik perdata atau kriminal kepada pengunjung yang mendapatkan E-voucher dengan ilegal termasuk memalsukan dan menggandakan E-voucher yang sah atau mendapatkan E-voucher dengan cara yang tidak sesuai prosedur.</strong></li></ol></li><li><strong>Harap mematuhi protokol kesehatan yang diterapkan penyelenggara di area venue, mencuci tangan, menggunakan masker, dan menjaga jarak (3M).</strong></li><li><strong>Pihak penyelenggara menindak tegas, dan berhak mengeluarkan pengunjung apabila tidak mematuhi protokol kesehatan yang telah diterapkan.</strong></li><li><strong>Dilarang membawa makanan dan minuman dari luar ke dalam venue.</strong></li><li><strong>Dilarang membawa dan menggunakan segala obat-obatan terlarang, narkoba, psikotropika, atau barang-barang yang mengandung zat berbahaya lainnya.</strong></li><li><strong>Dilarang membawa senjata tajam/api, bahan peledak, serta benda-benda yang dilarang berdasarkan ketentuan perundangan yang berlaku ke dalam venue.</strong></li><li><strong>Dilarang membawa kamera profesional ke dalam venue (mirrorless, dslr, dan sejenisnya).</strong></li><li><strong>Cara Menggunakan E-Ticket:</strong><ol><li><strong>Pada hari kunjungan pastikan E-voucher Anda sudah siap untuk ditunjukkan ke tim rate di venue</strong></li><li><strong>E-voucher tidak perlu di print. Anda dapat langsung masuk menggunakan E-voucher dengan memindai kode barcode pada Handphone kalian&nbsp;</strong></li><li><strong>Mohon menyesuaikan tingkat kecerahan layar telepon genggam Anda sebelum memindai kode barcode.</strong></li><li><strong>Hanya E-voucher Anda yang berlaku. Kwitansi atau bukti pembayaran tidak dapat digunakan sebagai masuk ke venue.</strong></li><li><strong>Jika kalian membeli lebih dari 1 tiket dalam 1 transaksi / kolektif, kalian wajib masuk bersamaan.</strong></li></ol></li><li><strong>E-voucher yang anda terima adalah tanggung jawab pembeli. Harap menjaga dan tidak menyebarluaskan unique code yang ada di E-voucher.&nbsp;</strong></li><li><strong>E-voucher yang sudah di beli tidak dapat dikembalikan.</strong></li></ol>','online','-','DI Yogyakarta','Sleman','2022-07-29','2022-07-29','19:00:00','22:00:00',0,'Sponsors Media Partner','https://www.instagram.com/asha.akasa',NULL,NULL,1,'2022-07-29 14:53:21','2022-08-26 10:54:15',NULL,0,NULL),(32,1,'noah-1-dekade','NOAH 1 DEKADE','Concert','Live Music & Concert','Noah DekadeXperience','20220720024042.png','<p>Noah DekadeXperience : Show spektakuler perjalanan 10 tahun NOAH yang akan memberikan kamu multiexperience. Hadir dalam 2 format , Festival Experience dan Theater Special Show di hari yang bersamaan.</p><p>Di FESTIVAL EXPERIENCE kamu akan melihat berbagai macam Instalasi Art perjalanan Noah selama 1 Dekade dengan diiringi pertunjukan musik&nbsp; SPEKTAKULER dari NOAH dan Surprising Act dari berbagai musisi keren lainnya.</p><p>Di THEATER SPECIAL SHOW, kamu akan mendapatkan pertunjukan exclusive dari NOAH, karena para penonton di theater akan menyaksikan format yang berbeda dari sebelumnya.</p><p>Kamu mau nonton NOAH di Theater Special Show dengan harga tiket include Festival Experience atau mau langsung menikmati suasana musik festival dengan hanya membeli tiket Festival Experience?</p><p>Tinggal pilih dan pastinya seruuu gilaaaaa!!!!</p><p><strong>Disclaimer</strong> : Pembelian Tiket Theater Special Show sudah termasuk Festival Experience, tapi tidak berlaku sebaliknya.</p>','offline','<p>Jakarta International Expo</p>','DKI Jakarta','Jakarta Pusat','2022-09-17','2022-09-17','15:00:00','23:00:00',1,'Stage and Session','https://www.instagram.com/newliveentertainment/',NULL,NULL,0,'2022-08-14 17:18:12','2022-08-18 16:54:25',NULL,0,'IdoHPVPR9K166047653814-Aug-2022'),(33,10,'dailyhotelsid','Dailyhotelsid','Conference','Conference',NULL,'007.jpg','<p>world tourism day</p>','online','-','Jawa Timur','Sidoarjo','2022-08-24','2022-08-25','12:00:00','12:00:00',0,'Stage and Session Sponsors Exihibitors Media Partner',NULL,NULL,NULL,0,'2022-08-15 13:53:33','2022-08-15 13:53:33',NULL,0,'oeprW0wf9v166054641315-Aug-2022'),(34,11,'bebas-eo','bebas EO','Concert','Live Music & Concert','bebas bebas bebas','LOGO Premiere agency.png','<p>njdnjebefj wjwkjkww</p>','online','-','Bali','Denpasar','2022-08-16','2022-08-16','12:00:00','18:00:00',0,'Stage and Session Sponsors Exihibitors Media Partner','https://instagram.com/sjnsnajsna','https://twitter.com/sjnsnajsna','https://instagram.com',1,'2022-08-15 14:30:14','2022-08-24 09:47:40',NULL,0,'FRETRevFXn166054861415-Aug-2022'),(35,13,'indigoseries-offline-workshop-optimizing-the-best-technology-for-your-startup','IndigoSeries Offline Workshop - Optimizing The Best Technology for Your Startup','Workshop','Workshop',NULL,'Header GFORM SPACE Offline Event Pack.jpg','<p>Halo, Startup Enthusiast!<br>.<br>Tentunya kalian sudah sering mendengar beberapa technology yang lagi trend di kalangan pegiat startup seperti IoT, blockchain, big data, Artificial Intelligence, Virtual Reality, cloud computing serta yang lainnya, kan?<br>.<br>Nah, kira-kira bagaimana peran teknologi tersebut terhadap optimalisasi startup digital kalian?<br>.<br>Penasaran? Yuk temukan jawabannya pada workshop #IndigoSeries yang akan membahas “Optimizing the Best Technology for Your Startup” Bersama narasumber keren @royyan_nobeel yang merupakan Co-Founder of Viding.co.<br>.<br>Catat waktu dan tanggalnya ya!<br><br>📅 &nbsp; &nbsp;: Selasa, 23 Agustus 2022<br>⏰ &nbsp; &nbsp;:19.00-21.00 WIB<br>🔗 &nbsp; &nbsp;: goers.co/eventsubagustus<br>📍 &nbsp; &nbsp; &nbsp;: OFFLINE at IndigoSpace Surabaya<br>Jl. Bendul Merisi Selatan Airdas No. 55 Surabaya<br><br>Jangan lupa, ajak teman kalian ikut serta ya, dan find the the best technology for your startup! 🔥🔥<br>.<br>See you 👋</p>','offline','<p>&nbsp;IndigoSpace Surabaya<br>Jl. Bendul Merisi Selatan Airdas No. 55 Surabaya</p>','Jawa Timur','Surabaya','2022-08-23','2022-08-23','19:00:00','21:00:00',1,'KOSONG','https://instagram.com/indigospace.surabaya','https://twitter.com/indigospacesub','https://indigo.id',0,'2022-08-16 15:25:41','2022-08-18 15:24:07',NULL,0,'6VEBGeivfZ166063834116-Aug-2022'),(36,1,'indonesia-markplus-festival-surabaya-human-50','Indonesia MarkPlus Festival - Surabaya HUMAN 5.0','Conference','Conference','JURUS JITU JATIM BANGKIT','WhatsApp Image 2022-08-23 at 3.08.22 PM.jpeg','<p>Dengan tema <strong>“ENTREPRENEURIAL MARKETING: JURUS JITU JATIM BANGKIT”</strong>. MarkPlus akan mengupas strategi bangkit di era pasca pandemi melalui jurus-jurus jitu <strong>CI-EL </strong>(<i>Creativity, Innovation, Entrepreneurship dan Leadership</i>). Dapatkan strategi untuk menemukan dan mengeksekusi peluang baru agar bisnis Anda