lusive dari NOAH, karena para penonton di theater akan menyaksikan format yang berbeda dari sebelumnya.</p><p>Kamu mau nonton NOAH di Theater Special Show dengan harga tiket include Festival Experience atau mau langsung menikmati suasana musik festival dengan hanya membeli tiket Festival Experience?</p><p>Tinggal pilih dan pastinya seruuu gilaaaaa!!!!</p><p><strong>Disclaimer</strong> : Pembelian Tiket Theater Special Show sudah termasuk Festival Experience, tapi tidak berlaku sebaliknya.</p>','offline','<p>Pulau Natuna</p>','Kepulauan Riau','Natuna','2022-09-01','2022-09-13','19:00:00','21:00:00',0,'Stage and Session',NULL,NULL,NULL,1,'2022-08-22 14:02:44','2022-08-22 14:11:46',NULL,0,'whd4oYBd5b166115176422-Aug-2022'),(39,5,'indonesia-markplus-festival-joglosemar','Indonesia MarkPlus Festival - JOGLOSEMAR','Festival & Fair','Show & Festival',NULL,'markplus.jpg','<p>Setelah 9 tahun berturut-turut di selenggarakan Festival Pemasaran terbesar dan terakbar di Indonesia kembali di gelar secara <i>online</i> dan <i>offline</i>, <strong>Indonesia MarkPlus Festival (IMF).</strong></p><p>Dengan tema <strong>“ENTREPRENEURIAL MARKETING: JURUS JITU BALI BANGKIT”</strong>. MarkPlus akan mengupas strategi bangkit di era pasca pandemi melalui jurus-jurus jitu <strong>CI-EL </strong>(<i>Creativity, Innovation, Entrepreneurship dan Leadership</i>). Dapatkan strategi untuk menemukan dan mengeksekusi peluang baru agar bisnis Anda dapat kembali maju. Lengkap bersama contoh praktis dari pelaku bisnis lokal dan nasional! Jangan lewatkan pula inspirasi dari para penerima penghargaan <strong>Industry Marketing Champion 2022</strong> di daerah anda di pandu langsung oleh Bapak Hermawan Kartajaya – <i>Founder &amp; Chairman </i>MarkPlus Inc dan Dr. Jacky Murry – <i>CEO </i>MarkPlus Inc.</p><p>Segera bergabung di Festival Pemasaran terbesar &amp; terakbar di Indonesia</p><p>Syarat &amp; Ketentuan</p><ol><li>Tiket ini berlaku untuk 1 (satu) orang dan satu kali pemakaian.</li><li>Tidak ada penggantian program bagi peserta yang berhalangan hadir.</li><li>Dengan mendaftarkan diri Anda, maka dianggap mengerti &amp; menyetujui syarat dan ketentuan yang berlaku.</li><li>Peserta diharapkan hadir langsung pada tanggal dan waktu yang tertera karena acara akan dilaksanakan secara offline dan tidak terdapat tayangan ulang ataupun memperoleh recording dari acara.</li></ol>','offline','<p>Hotel Santika Premiere Semarang</p>','Jawa Tengah','Semarang','2022-08-31','2022-08-31','09:00:00','17:00:00',0,'Stage and Session Sponsors Exihibitors Media Partner','https://www.instagram.com/markplusinc/','https://twitter.com/markplus_inc','https://www.markplusinc.com/',1,'2022-08-22 14:13:23','2022-08-26 10:55:03',NULL,0,'mdCeb6nj50166115240322-Aug-2022'),(40,15,'surabaya-great-expo-2022','SURABAYA GREAT EXPO 2022','Exhibition','Exhibition','UMKM KUAT SURABAYA HEBAT','AGENDA KOTA2.jpg','<p>Pameran berskala Nasional dari Kota Surabaya ini untuk menarik buyers, traders, Investor dalam usaha memperluas jaringan pasar nasional maupun global. Disamping itu SURABAYA GREAT EXPO 2022 KE-11 mempunyai misi memulihkan perekonomian di era pandemi sebagai ajang Promosi, hiburan ,Belanja dan rekreasi keluarga bagi semua lapisan masyarakat.</p>','offline','<p>EXHIBITION HALL GRAND CITY CONVEX SURABAYA</p>','Jawa Timur','Surabaya','2022-08-24','2022-08-28','12:00:00','21:00:00',1,'Stage and Session Exihibitors Media Partner','https://www.instagram.com/surabayagreatexpo/?hl=id',NULL,'http://surabayagreatexpo.com/',0,'2022-08-22 16:00:54','2022-08-24 10:33:44',NULL,4,'mjJCph5Okg166115885422-Aug-2022'),(41,5,'startup-gathering-taipei-indonesia-exchange-agrifood-tech-meetup-pitch-day27-08-22_15:43:19_155','STARTUP GATHERING - Taipei - Indonesia Exchange : AgriFood Tech Meetup Pitch Day','Meet-up& Gathering','Talkshow',NULL,'startup gathering.jpg','<p><strong>STARTUP GATHERING - Taipei-Indonesia Exchange: AgriFood Tech Meetup Pitch Day | Open for registration!</strong></p><p><strong>Spice it up!&nbsp;</strong></p><p>What role does FoodTech play during and after Covid-19? Aside from food delivery systems, there are many other solutions that turn the agrifood industry into a more up-to-date, sustainable and efficient sector in all its stages - from food production, to distribution, and lastly, methods of consumption.</p><p>By joining this event, you can gain current knowledge and insights delivered by a FoodTech-focused VC/accelerator and get in touch with the modern solutions used in the industry through a pitch session from 4 startups based in Indonesia. Enjoy a taste of intelligence with us!</p><p><strong>Speaker Lineup&nbsp;</strong></p><ul><li>Diah Yusuf, Founder, Indonesia Prima</li><li>Victor Chen, Founder &amp; CEO, Foodland Ventures 扶田資本</li></ul><p>This event will be public and OPEN TO ALL. If you have any additional questions, please reach out to us!</p>','offline','<p>MULA by Galeria Jakarta</p>','DKI Jakarta','Jakarta Selatan','2022-09-01','2022-09-01','14:00:00','16:00:00',1,'Stage and Session Sponsors',NULL,NULL,NULL,0,'2022-08-27 15:36:12','2022-08-27 15:45:09',NULL,0,'znThjO1EAL166158937227-Aug-2022'),(42,5,'pameran-seni-rupa-dua-musim27-08-22_17:09:23_155','Pameran Seni Rupa Dua Musim','Exhibition','Exhibition',NULL,'pameran seni rupa.jpg','<p><strong>\"DUA MUSIM\" Karya I MADE ARYA PALGUNA :</strong></p><p>Dua Musim adalah Pameran Tunggal I Made Arya Palguna di Yogyakarta sejak ia pulang ke kampung halamannya di Bali. Yogyakarta merupakan kota yang memiliki peran penting dalam membentuk identitas dan karakternya sebagai seorang seniman.</p><p>Bagaimana Palguna mengekspresikan kegelisahannya, tentang perbedaan musim antara Yogyakarta dan Bali, dalam bahasa visual??&nbsp;</p><p><strong>Protokol kesehatan yang kami lakukan:</strong></p><ul><li>Wajib mencuci tangan dengan air mengalir /<i>hand sanitizer</i>.</li><li>Wajib selalu menggunakan masker saat berada di area ruang pamer, termasuk saat mengambil foto dan swafoto.</li><li>Anda <i><strong>Wajib</strong></i> untuk <i><strong>memindai QR Code Pedulilindungi&nbsp;</strong></i>yang tersedia di pintu masuk atau memperlihatkan sertifikat vaksin jika tidak memiliki aplikasi PeduliLindungi, sebelum masuk ke ruang Pamer.</li><li>Melakukan cek suhu badan sebelum memasuki area Jogja Gallery&nbsp;dan untuk dapat memasuki area Jogja Gallery,&nbsp;suhu maksimal 37,3 °C.</li><li>Pembatasan usia pengunjung :<ul><li>Anak-anak diperkenankan masuk dengan didampingi (dalam pengawasan) orang tua.</li><li>Lanjut usia maksimal 70 tahun.</li></ul></li><li>Pembatasan durasi kunjungan ± 1 jam.</li><li>Pemberlakuan jaga jarak antar pengunjung.</li><li>Area Jogja Gallery akan dilakukan sterilisasi/pembersihan setiap &nbsp;jam 12.00 – 13.00 WIB.</li></ul><p><strong>Tata tertib kunjungan di ruang pamer:</strong></p><ul><li>Tidak boleh menyentuh dan memegang seluruh karya seni (kecuali karya seni interaksi).</li><li>Tidak boleh menggunakan flash kamera, tripod dan tongkat selfie saat mengambil gambar.</li><li>Tidak boleh makan, minum dan merokok dalam ruang pamer.</li><li>Tidak boleh membawa binatang peliharaan ke dalam ruang pamer.</li><li>Tidak ada tempat penyimpanan barang, bawalah tas berukuran kecil sehingga anda dapat membawanya ke dalam ruang pamer.</li></ul>','offline','<p>Jogja Gallery, D.I Yogyakarta</p>','DI Yogyakarta','Yogyakarta','2022-08-19','2022-09-19','10:00:00','18:00:00',1,'Exihibitors','https://www.instagram.com/jogja_gallery/','https://twitter.com/JogjaGallery','https://jogjagallery.net/',0,'2022-08-27 17:09:23','2022-08-27 17:27:57',NULL,0,'zkH4orm4X4166159496327-Aug-2022'),(43,5,'influencer-marketing-101-lead-opinion-into-brands-trust27-08-22_17:15:34_155','Influencer Marketing 101 : Lead Opinion into Brand\'s Trust','Workshop','Workshop',NULL,'influencer.jpg','<p>Mau jadi brand yang paling disayang Netizen? Yuk belajar mengambil hati Netizen dengan Influencer Marketing!</p><p>Vokraf mengadakan kelas Mini Bootcamp Influencer Marketing yang cocok banget untuk kamu!<br>Diajar oleh&nbsp;<strong>Dinda Syifana Almira</strong>,&nbsp;<strong>Influencer Marketing Supervisor @ Sharkmind Group</strong></p><p><strong>Materi yang akan dipelajari:</strong></p><ul><li><strong>Video Learning (29-30 August 2022)</strong><br>Material Points<br>- Why brand using influencer on their marketing activity<br>- Understand the difference between KOL and influencer<br>- When the brand needs influencer/KOL<br>- Scope of work of influencer/KOL<br>- Best practice of using influencer/KOL<br>- Tips on doing collaboration with influencer/KOL<br>- How to choose influencer and aligning with marketing goal<br>- KOL/influencer research<br>- Category of KOL<br>- Let\'s talk about ratecard and payment process<br>- Why me need brief and what we put on &nbsp;the brief<br>- Working timeline with KOL<br>- How to monitoring the content<br>- How to read the report(metrics)</li><li><strong>Live Session Class (31 August 2022)</strong><br>Materi Points<br>- Review video materials<br>- Group workshop<br>- QnA live session<br><br>&nbsp;</li><li><strong>Workshop Presentation (2 September 2022)</strong><br>Materi Points<br>- Feedback session with expert<br>- Live QnA and Discussion</li></ul><p><strong>Kamu akan mendapatkan:</strong></p><ul><li>Konsultasi langsung dengan Expert</li><li>E-Certificate</li><li>Training modules</li><li>Workshop &amp; Portfolio</li><li>Networking</li></ul><p>&nbsp;</p><p>Syarat &amp; Ketentuan</p><ul><li>Kelas terdiri dari video learning dan live session yang bisa diakses melalui learning platform Vokraf Levelup</li><li>Learning platform bisa diakses melalui link yang akan disampaikan pada group kelas</li><li>Lakukan registrasi pada Learning platform dengan memasukan sesuai data yang dibutuhkan</li><li>Live session class akan dimulai pukul 19.00 WIB, dan dapat diakses melalui learning platform setelah menyelesaikan semua video learning.</li><li>Live session class akan dibawakan dalam Bahasa Indonesia</li><li>Narahubung email cs@vokraf.com subject Vokraf Level Up atau Whatsapp ke +62 851 6126 5200</li></ul>','offline','<p>WOKRAF, Jakarta Selatan</p>','DKI Jakarta','Jakarta Selatan','2022-08-29','2022-09-02','19:00:00','21:00:00',1,'KOSONG',NULL,NULL,'https://vokraf.com/prakerja',0,'2022-08-27 17:15:34','2022-08-27 17:27:47',NULL,0,'nYWcQa2nOX166159533427-Aug-2022'),(44,5,'manggungdi27-08-22_17:19:58_155','ManggungDi','Concert','Live Music & Concert',NULL,'ManggungDi.jpg','<p>Music Festival • Creative Hub • Pop-up Market</p><p>Manggungdi adalah festival yang menampilkan musisi nasional dan internasional serta creativepreneur dan food bazaar.</p><p>Day 1:<br>Anna Hamilton • Rizky Febian • NTRL • Ndarboy Genk • Rendy Pandugo • Basboi • Base Jam • Sisitipsi • Planet Bumi • Rumahsakit</p><p>Day 2:<br>Tipe-X • Andra &amp; The Backbone • Yura Yunita • Fourtwnty • Kangen Band • Fiersa Besari • Jason Ranti • Eros Tjokro •&nbsp; Reality Club • Calliope&nbsp;</p><p>Sabtu dan Minggu, 3-4 September 2022 di Edutown Arena BSD City, Tangerang Selatan.</p><p>#Manggungdi&nbsp;Edutown Arena, BSD City kali ini adalah awal dari rangkaian festival yang dimeriahkan oleh musisi, seniman, pelaku kreatif, dan UMKM yang bakal terus berlanjut dengan kegiatan seru #ManggungDi&nbsp;lokasi lainnya.</p><p>Bertemakan Live, Life, dan Lit, #ManggungDi bukan sekadar festival musik, tapi akan ada Creative Hub sebagai wadah lo ketemu sama para pelaku kreatif keren. Bahkan, lo juga bisa dukung bisnis lokal dengan belanja di Pop-up Market.</p><p>Let’s get live, life, and lit at #ManggungDi!</p><p>Info lebih lengkap, kunjungi Instagram (www.instagram.com/manggungdi/) dan website <a href=\"http://manggungdi.com/\">manggungdi.com</a>.</p><p>Syarat &amp; Ketentuan</p><p><strong>REGULASI DAN ATURAN TIKET:</strong></p><ul><li>Dengan membeli tiket #Manggungdi dan memasuki lokasi acara, pengunjung mengakui dan menyetujui segala ketentuan dan regulasi yang ditetapkan penyelenggara.</li><li>Tiket yang sah adalah tiket yang dibeli dengan tata cara yang telah ditentukan yaitu pembelian secara online melalui transaksi elektronik pada tiket box resmi yang ditunjuk oleh Penyelenggara sesuai dengan yang tertera pada website.</li><li>Maksimum pembelian 5 (lima) tiket dalam satu transaksi.</li><li>Tiket yang sudah dibeli tidak dapat ditukar, dikembalikan, atau diuangkan.</li><li>Tiket tidak bisa dipindahtangankan.</li><li>WAJIB membawa KTP, paspor atau identitas diri lainnya. Tanda identitas diri akan dicek sebelum memasuki area #Manggungdi.</li><li>Data pada <i>e-ticket</i> harus sama dengan data KTP atau paspor yang diberikan.</li><li>Tiket menggunakan sistem <i>barcode</i> dan berlaku untuk satu kali penggunaan untuk satu orang.</li><li>1 (satu) tiket hanya berlaku untuk 1 (satu) orang dan 1 (satu) kali masuk per hari dan atau sesuai dengan kategori tiket tertulis.</li><li>Penyelenggara tidak bertanggung jawab atas kelalaian pembeli tiket yang mengakibatkan tiket jatuh ke tangan orang lain (dalam penguasaan orang lain) untuk dipergunakan sebagai tanda masuk tempat pertunjukan yang menghilangkan hak dari pembeli tiket.</li><li>Apabila terdapat pembatalan acara maka tiket dapat diuangkan kembali sesuai ketentuan Penyelenggara.</li><li>Penonton WAJIB mematuhi Protokol Kesehatan yang berlaku di seluruh area #Manggungdi. WAJIB memakai masker selama berada di area #Manggungdi.</li></ul><p><strong>PROTOKOL KESEHATAN:</strong></p><ul><li>Semua pihak WAJIB mematuhi dan melaksanakan protokol kesehatan yang berlaku di area #Manggungdi.</li><li>Pengunjung wajib mengunduh aplikasi PeduliLindungi dengan akun yang telah terverifikasi.</li><li>Sebelum memasuki area #Manggungdi, penonton WAJIB cek suhu tubuh serta sudah memiliki sertifikat vaksin sebanyak minimal 2 (dua) sertifikat.</li><li>Menerapkan etika bersin dan batuk.</li><li>Menghindari kontak fisik.</li><li>Menjaga kebersihan tangan dengan mencuci tangan menggunakan air mengalir atau hand sanitizer.</li><li>Disarankan membawa peralatan dan perlengkapan pribadi yang diperlukan. Seperti botol minum, alat makan, dan lainnya.</li></ul>','offline','<p>Edutown Arena, Banten</p>','Banten','Tangerang','2022-09-03','2022-09-04','12:00:00','22:00:00',1,'KOSONG','https://www.instagram.com/edutownarena/',NULL,NULL,0,'2022-08-27 17:19:58','2022-08-27 17:27:38',NULL,0,'PHMJisHd0s166159559827-Aug-2022'),(45,5,'explore-sumba27-08-22_17:25:47_155','Explore Sumba','Accommodation','Attraction',NULL,'explore sumba.jpg','<p><strong>Day 1</strong></p><p><strong>- Meeting Point Bandara Tambolaka</strong></p><p>- Kampung Ratenggaro</p><p>- Pantai Ratenggaro</p><p>- Pantai Mbawana</p><p><strong>Day 2</strong></p><p>- Weekuri Lagoon</p><p>- Pantai Mandorak</p><p>- Kampung Prai ijing</p><p>- Air Terjun Lapopu</p><p><strong>Day 3</strong></p><p>- Savana Purukambera</p><p>- Air Terjun Tanggedu</p><p>- Pantai Walakiri</p><p><strong>Day 4</strong></p><p>- Bukit Wairinding</p><p>- Kerajinan Tenun Ikat Sumba</p><p>- Bukit Persaudaraan</p><p><strong>- Drop off (Finish) Bandara Waingapu (WGP) Jam 11.00</strong></p>','offline','<p>Bandara Tambolaka, Nusa Tenggara Timur</p>','Nusa Tenggara Timur (NTT)','Sumba Barat Daya','2019-10-24','2022-12-31','12:55:00','15:55:00',1,'KOSONG',NULL,NULL,NULL,0,'2022-08-27 17:25:47','2022-08-27 17:27:28',NULL,0,'IgREGJk5Cq166159594827-Aug-2022'),(46,6,'lo-semua-sama-aja-surabaya29-08-22_09:45:41_166','LO SEMUA SAMA AJA - SURABAYA','Show & Performance','Show & Festival',NULL,'WhatsApp Image 2022-08-29 at 09.41.20.jpg','<p>STANDUPCOMEDY TOUR BY ADRIANO QALBI</p><p>Syarat &amp; Ketentuan</p><ul><li>Tiket yang sudah dibeli tidak dapat dikembalikan (non-refundable).</li><li>Tiket yang sudah dibeli tidak dapat diganti jadwalnya, Kecuali ada perubahan dari pihak penyelenggara karena satu dan lain hal.</li><li>Pembeli wajib mengisi data diri pribadi saat memesan.</li><li>Penjualan tiket sewaktu-waktu dapat dihentikan atau dimulai oleh tiket.com sesuai dengan kebijakan dari promotor.</li><li>Pengunjung wajib sudah vaksin dan memiliki aplikasi Peduli Lindungi.</li><li>Pengunjung wajib menggunakan masker selama acara berlangsung.</li><li>Pengunjung wajib menjaga protokol kesehatan yang berlaku.</li></ul><p>Label</p><p>MLI majelislucuindonesia AdrianoQalbi</p>','offline','<p>Jl. Kanginan I 1-19, Ketabang, Kec. Genteng, Kota SBY, Jawa Timur 60272</p>','Jawa Timur','Surabaya','2022-09-16','2022-09-16','19:00:00','21:00:00',1,'Stage and Session','https://www.instagram.com/majelislucuindonesia/',NULL,NULL,0,'2022-08-29 09:45:41','2022-08-29 09:49:26',NULL,0,'Ut6Tx7bU70166174114129-Aug-2022'),(47,6,'all-out-festival29-08-22_09:56:17_166','ALL OUT FESTIVAL','Concert','Live Music & Concert',NULL,'WhatsApp Image 2022-08-29 at 09.51.34.jpg','<p>Event ini adalah konser yang diadakan oleh FM Production dalam rangka festival UMKM Food, Fashion, and Music.</p><p>Mekanisme Pemesanan Tiket :&nbsp;</p><p>1. Klik link pada bio instagram @all_out_festival<br>2. Masuk ke halaman tiket, pilih tiket yang akan dibeli dengan menambahkan ke keranjang pemesanan<br>3. Klik menu keranjang lalu chechkout tiket yang telah dipilih<br>4. Isi data yang diperlukan (Pastikan mengisi data dengan benar)<br>5. Pilih metode pembayaran dan lakukan pembayaran sebelum batas waktu pembayaran berakhir&nbsp;<br>6. E-ticket akan dikirim ke email yang teregristrasi<br>7. Penukaran gelang tiket online dan offline dilakukan pada H-1 atau hari H konser.&nbsp;</p><p>Syarat &amp; Ketentuan</p><ul><li>Harga sudah termasuk pajak.</li><li>Tiket yang sudah dibeli tidak dapat dikembalikan dan non-refundable.</li><li>Tiket yang sudah dibeli tidak dapat diganti jadwalnya</li><li>Pembeli wajib mengisi data diri pribadi saat memesan.</li><li>Pengunjung wajib menggunakan masker selama acara berlangsung.</li><li>Pengunjung wajib menjaga protokol kesehatan yang berlaku.</li><li>Pengunjung harus sudah divaksinasi.</li><li>Disarankan tidak membawa anak – anak di bawah umur 12 tahun.</li></ul><p>Label</p><p>dennycaknan</p>','offline','<p>Jakarta Pusat, Gambir, Kecamatan Gambir, Kota Jakarta Pusat, Daerah Khusus Ibukota Jakarta</p>','Jawa Timur','Bojonegoro','2022-09-04','2022-09-04','15:00:00','22:00:00',1,'Stage and Session','https://www.instagram.com/all_out_festival/',NULL,NULL,0,'2022-08-29 09:56:17','2022-08-29 10:01:28',NULL,0,'sYWXSeFCb9166174177729-Aug-2022'),(48,6,'dunia-fantasi-dufan29-08-22_10:16:19_166','Dunia Fantasi / Dufan','Atraction & Themepark','Attraction',NULL,'WhatsApp Image 2022-08-29 at 10.11.44.jpg','<p>Dunia Fantasi atau yang lebih populer dengan sebutan Dufan, pertama kali dibuka untuk umum pada 29 Agustus 1985 dan merupakan theme park pertama yang dikembangkan oleh Perseroan dan telah memiliki sertifikat ISO 9001:2015 sejak Februari 2017.<br><br>Selain menjadi pusat hiburan outdoor, Dufan juga merupakan kawasan edutainment fisikia terbesar di Indonesia yang memanjakan pengunjung dengan Fantasi Keliling Dunia, melalui wahana permainan berteknologi tinggi, yang terbagi dalam 9 (Sembilan) kawasan yaitu Indonesia, Jakarta, Asia, Eropa, Amerika, Yunani, Hikayat, Kalila dan Fantasy Lights.<br><br>Fasilitas umum untuk pengunjung : Gratis pinjam Stroller Bayi dan Kursi Roda, Free Wifi, Charger Point, Toilet bersih disetiap kawasan dan wahana, Baby Care Room, Mushola dan Masjid, P3K dan Ambulance.</p><p>Syarat &amp; Ketentuan</p><p>Ketentuan dan Cara Penggunaan Eticket Dufan :&nbsp;</p><ol><li>Tiket hanya berlaku sesuai dengan tanggal kunjungan yang di pilih saat pembelian</li><li>Eticket yang sudah dibeli tidak dapat di reschedule dan dikembalikan (non-refundable).</li><li>Tinggi badan minimal 100 cm sudah dikenakan biaya tiket penuh, dibawah 100 cm gratis</li><li>Eticket berlaku untuk 1 Orang, 1 kali pemakaian</li><li>Eticket termasuk tiket masuk Ancol (1x kunjungan)</li><li>Eticket tidak termasuk tiket Kendaraan</li><li>Semua jenis tiket bundling unit, maka tiket wajib digunakan di hari yang sama untuk seluruh unit tersebut.</li><li>Jam Operasional Ancol dan Unit Rekreasi Ancol (01 Agustus - 30 Sep 2022, khusus Dunia Fantasi 01 - 31 Agustus 2022):<ol><li>Taman Impian&nbsp;<ol><li>Pintu Gerbang : Pukul 06.00 - 20.00 WIB</li><li>Kawasan Taman Pantai : Pukul 06.00 - 21.00 WIB</li></ol></li><li>Dunia Fantasi<ol><li>Tgl. 01 - 31 Agustus 2022 : Pukul 10.00 - 17.00 WIB</li></ol></li><li>Sea World Ancol&nbsp;<ol><li>Weekday : Pukul 09.30 - 16.30 WIB</li><li>Weekend : Pukul 09.00 - 16.30 WIB</li></ol></li><li>Ocean Dream Samudra<ol><li>Weekday : Pukul 09.30 - 16.30 WIB</li><li>Weekend : Pukul 09.00 - 16.30 WIB</li></ol></li><li>Atlantis Water Adventures<ol><li>Weekday : Pukul 09.00 - 15.30 WIB</li><li>Weekend : Pukul 08.00 - 15.30 WIB</li></ol></li></ol></li><li>Loket Taman Impian dan Dufan ditutup 1 jam lebih awal dari Jam Operasional yang berlaku.&nbsp;</li></ol><p><br>&nbsp;</p><p>Ketentuan dan Cara Menggunakan Annual Pass (Ecard) :</p><p><br>&nbsp;</p><ol><li>Eticket harus dijadikan Ecard terlebih dahulu sebelum memasuki unit rekreasi.</li><li>Aktivasi ecard maksimal dilakukan sesuai tanggal kunjungan yang dipilih (aktivasi ecard tidak dapat dilakukan setelah tanggal kunjungan yang dipilih).</li><li>Jika tidak melakukan aktivasi ecard (maksimal pada hari kunjungan), maka eticket berlaku seperti tiket reguler 1x kunjungan.</li><li>Mekanisme pengaktifan E-Card :<ol><li>Klik Link :&nbsp;<a href=\"http://bit.ly/ecardpass\"> http://bit.ly/ecardpass</a></li><li>Agar bisa scan tiket kamu dan photo melalui kamera pastikan kamu pilih â€œallow cameraâ€ (Photo tanpa masker)</li><li>Masukkan nomor tiket Annual Pass atau scan tiket kamu dan klik tombol â€œkirimâ€&nbsp;</li><li>Masukkan data diri kamu dengan benar, Ecard akan dikirim ke email (pastikan email benar dan aktif), bila sudah ok, klik tombol â€œLanjutâ€</li><li>Sekarang photo wajah kamu, pastikan wajah kamu jelas terlihat di photo klik tombol â€œkameraâ€ untuk photo (Paskan wajah kamu dikotak bila sudah, klik tombol â€œBuat Ecardâ€) - Photo tanpa menggunakan masker.</li><li>Selamat! Ecard kamu sudah jadi!</li><li>Cek email kamu atau bisa langsung download klik â€œDownload Ecardâ€</li><li>Untuk kunjungan berikutnya, wajib melakukan reservasi sebelum kunjungan dengan memasukkan (input) nomor Ecard di :<a href=\"http://reservasi.ancol.com/\"> reservasi.ancol.com</a> dan selama kuota tersedia.</li><li>Jika terjadi penyalahgunaan pada ecard, maka ecard akan di nonaktifkan.</li></ol></li></ol><p><br>&nbsp;</p><p>Cara Penggunaan Eticket :</p><p><br>&nbsp;</p><ol><li>Pada hari kunjungan pastikan Ecard Anda sudah siap untuk ditunjukkan di pintu masuk taman rekreasi untuk di Pintu Gerbang Ancol, tunjukkan eticket pembelian.</li><li>Anda dapat langsung masuk dengan memindai kode QR pada Ecard Anda di Pintu Masuk taman rekreasi.</li><li>Mohon menyesuaikan tingkat kecerahan layar telepon genggam Anda sebelum memindai kode QR pada Ecard.</li><li>Hanya Eticket dan Ecard (untuk tipe tiket Annual Pass) yang berlaku. Kuitansi atau bukti pembayaran tidak dapat digunakan sebagai tiket masuk.</li></ol><p><br>&nbsp;</p><p>Ketentuan Umum :&nbsp;</p><p><br>&nbsp;</p><ol><li>Mematuhi seluruh syarat dan ketentuan serta kebijakan kunjungan yang ditetapkan oleh Ancol, antara lain sebagai berikut :</li></ol><ul><li>Dewasa wajib vaksin lengkap (dosis 1 dan 2) dan anak usia dibawah 12 tahun diperkenankan masuk tempat wisata dengan wajib didampingi orang tua dan menunjukkan bukti vaksinasi dosis pertama (kecuali tidak bisa divaksinasi karena alasan kesehatan).</li><li>Sudah divaksinasi Covid-19 (minimal vaksinasi dosis pertama) dan menunjukkan status vaksin, melakukan check in dan check out melalui aplikasi Pedulilindungi. Jika Ancol menemukan pelanggaran terhadap regulasi vaksin, maka Ancol Taman Impian berhak mengeluarkan yang bersangkutan.</li><li>Selalu menggunakan masker dengan benar dan menjaga jarak (tidak berkerumun) selama berada di dalam kawasan Ancol.</li><li>Mematuhi pembatasan jumlah kunjungan dan jam operasional serta ketentuan khusus lainnya yang berlaku di masing-masing unit rekreasi Ancol.&nbsp;</li><li>Lansia 70 tahun ke atas dan Ibu hamil belum diperbolehkan berkunjung ke Ancol sampai batas waktu yang belum ditentukan.</li><li>Anak usia dibawah 12 tahun diperbolehkan berkunjung ke kawasan Ancol dan unit rekreasi dengan wajib didampingi orang tua yang telah mendapatkan vaksin COVID-19 minimal Dosis Pertama dan selalu menerapkan protokol kesehatan yang berlaku termasuk 3M.</li><li>Bertanggung jawab secara penuh atas kebenaran informasi yang diberikan sehubungan dengan pemberian persetujuan ini.</li><li>Masuk kawasan Ancol Taman Impian berlaku ganjil genap kendaraan RODA 4 setiap hari Jumat - Minggu Pukul 12.00 - 18.00 Wib berlaku untuk Mobil dan Taksi Online kecuali Taksi Plat Kuning.</li><li>Wahana yang beroperasional sewaktu-waktu dapat berubah tanpa pemberitahuan terlebih dahulu.</li><li>Semua pengunjung wajib melaksanakan segala ketentuan yang diatur terkait penerapan social distancing dan mekanisme pembelian tiket, Ocean Dream Samudra dan sea World berhak untuk menolak dan/atau mengeluarkan setiap pengunjung yang datang apabila tidak mengikuti ketentuan yang sudah diatur.</li></ul>','offline','<p>Kec. Pademangan Kota Jkt Utara Daerah Khusus Ibukota Jakarta</p>','DKI Jakarta','Jakarta Utara','2022-06-25','2022-08-31','10:00:00','23:00:00',1,'Stage and Session',NULL,NULL,NULL,0,'2022-08-29 10:16:19','2022-08-29 10:22:57',NULL,0,'xFzCdaVBuq166174297929-Aug-2022'),(49,16,'study-excursie-2230-08-22_14:56:32_13916','STUDY EXCURSIE 22','Workshop','Workshop','Kunjungan ke Agendakota','Desain Header SE (2).png','<p>Study Excurse akan mengajak kalian untuk mengunjungi beberapa perusahaan ternama di surabaya. mulai dari Jawa Pos TV yang merupakan siaran TV lokal ternama yang berletak disurabaya yang sudah beroprasi 20 tahun lebih dan telah menghasilkan berbagai acara yang menarik, dilanjut dengan kunjungan ke Agenda kota yang merupakan Startup disurabaya yang bergerak dalam bidang penyelenggaraan Event yang ada di surabaya baik itu secara online, offline maupun hybrid., dan juga telah berhasil menyelenggarakan berbagai event menarik seperti jazz festival 22, Musication, dan masih banyak event keren lainnya. lalu terakhir kita memanjakan diri dengan berwisata di Atlantisland Surabaya &nbsp;yang menyediakan berbagai wahana menarik dan instagramable yang patut untuk dicoba. juga akan mendapatkan berbagai benefit menarik seperti Sertifikat, snack,dan berbagai benefit yang lain.&nbsp;</p><p>tunggu apalagi segerakan daftarkan dirimu, jangan sampai ketinggalan karena kuota terbatas !!.</p><p>&nbsp;<strong>NB : </strong>Acara ini hanya untuk mahasiswa Teknik Informatika ITN Malang.</p>','offline','<p>Koridor Coworking Space. Gedung Siola lt 3 Surabaya, Surabaya, Indonesia, 60275</p>','Jawa Timur','Surabaya','2022-09-12','2022-09-12','13:30:00','15:00:00',1,'KOSONG','https://instagram.com/hati_itn_malang?igshid=YmMyMTA2M2Y=','https://twitter.com/IT_ITN?s=20&t=mZfq_7PFx3_v3PIEN_FV7g',NULL,0,'2022-08-30 09:44:59','2022-08-30 15:01:39',NULL,0,'YQPVYhvijg166182749930-Aug-2022'),(50,15,'decorintex-202230-08-22_16:53:38_12015','Decorintex 2022','Exhibition','Exhibition','Pameran terbesar Interior','dn.jpg','<p>Decoration Interior Exhibition 2022 (Decorintex 2022) offers the best selection of products interior and exterior design, architectural, high end decoration interior technology, decorating, furnishing. The right place to give a new experience of lifestyle &amp; interesting design of ideas for residence and environment, thus providing the inspiration to realize the the ideal residence.</p><p>This event is an opportunity to discover the latest products and technologies to answer the needs of the decor and spatial planning. Bring business networking between industry, interior designers, and architects.</p>','offline','<p>Exhibition Hall Grand City Convex</p>','Jawa Timur','Surabaya','2022-09-21','2022-09-25','10:00:00','21:00:00',1,'Stage and Session Exihibitors',NULL,NULL,NULL,0,'2022-08-30 16:53:38','2022-08-31 10:26:01',NULL,6,'Hh8EJgTSpo166185321830-Aug-2022'),(51,1,'essential-project-management-batch-november-202207-09-22_05:27:55_11','Essential Project Management Batch November 2022','Workshop','Workshop',NULL,'20211214151705_61b85301263a6.jpg','<p><strong>Essential Project Management Batch November 2022</strong></p><p>Date : 7 - 9 November 2022</p><p>Time : 08.00 - 12.00 WIB</p><p>Platform : Zoom Online Meeting</p><p><strong>Description</strong></p><p>Project management is the discipline of planning and executing projects. Project management seeks to achieve defined goals by using plans, schedules and resources to execute project activities within a set timeframe.</p><p>Boost your project management skills as you learn how to best manage people, teams, and budgets, and examine the latest trends in project management.</p><p>&nbsp;</p><p><strong>Suitable for:</strong></p><ul><li>Project Secretary</li><li>Project Admin</li><li>PMO</li><li>Project Manager</li><li>Project Leader</li><li>Project Controller</li><li>Project Planner</li><li>Project Management Team, and anyone who is involved in, or affected by, projects management within an organization.</li></ul><p>&nbsp;</p><p><strong>Outline:</strong></p><p>Day 1</p><p><strong>Section 01</strong></p><ul><li>Project Management Overview</li><li>PM Process - Initating Process (Develop Project Charter &amp; Identify Stakeholder)</li></ul><p><strong>Section 02</strong></p><ul><li>PM Process - Planning (Understand to create Scope and WBS)</li></ul><p>Day 2</p><p><strong>Section 03</strong></p><ul><li>PM Process - Planning (Understand Project Management Plan, Project Schedule, Cost and Quality Management)</li></ul><p><strong>Section 04</strong></p><ul><li>PM Process - Planning (Project Resource Management, Communication, Risk, Procurement, Stakeholder Management)</li></ul><p>Day 3</p><p><strong>Section 05</strong></p><ul><li>PM Process - Executing</li></ul><p><strong>Section 06</strong></p><ul><li>PM Process - Monitoring &amp; Controlling</li><li>PM Process - Closing</li></ul><p>&nbsp;</p><p><strong>What will you get:</strong></p><ul><li>Slide presentation material</li><li>E-Certificate attendance</li></ul><p>&nbsp;</p><p>Syarat &amp; Ketentuan</p><p>&nbsp;</p><ul><li>Not refundable and cancellation ticket</li><li>E-Training will be conducted in Bahasa</li><li>The event will be held on 7 - 9 November 2022</li><li>We will sent the zoom link to your registered email maximum on 6 November 2022. make sure you are using correct valid full name and email address.</li><li>make sure tou are using the same email as the registered email when you join the link zoom</li><li>If you have any inquiries, please do not hesitate to reach out to our PIC abdullah.kurniawan@dayamitra.com</li></ul>','online','-','DKI Jakarta','Jakarta Selatan','2022-11-07','2022-11-09','08:00:00','12:00:00',0,'Stage and Session Sponsors Media Partner','https://instagram.com/sdm.corp',NULL,NULL,0,'2022-09-07 05:27:55','2022-09-07 05:27:55',NULL,0,'YQbHAUiDcS166250327507-Sep-2022'),(52,17,'blood-donation-holiday-inn-jakarta-kemayoran12-09-22_12:06:13_14317','Blood Donation - Holiday Inn Jakarta Kemayoran','Meet-up& Gathering','Anniversary','GIVING FOR GOOD','Blood Web Banner.png','<p>Mari bergabung bersama dengan seluruh IHG Hotels &amp; Resorts di acara Donor Darah pertama di 2022<br>Berbagi kebaikan untuk komunitas disekitar #givingforgood</p><p><i>free entry</i><br><br>Silahkan mendaftar melalui link berikut ini :&nbsp;<br>https://forms.gle/QraB1GVy38Qt9C5AA<br>&nbsp;</p>','offline','<p>Holiday Inn Jakarta Kemayoran&nbsp;<br>Jl. Griya Utama blok B no. 1<br>Jakarta - 14350</p>','DKI Jakarta','Jakarta Pusat','2022-09-26','2022-09-26','09:00:00','12:00:00',1,'KOSONG','https://www.instagram.com/holidayinnjakartakemayoran/','https://twitter.com/HIKemayoran','https://jakartakemayoran.holidayinn.com/',0,'2022-09-12 12:06:13','2022-09-12 12:06:59',NULL,0,'3IYG39zAdc166295917312-Sep-2022'),(53,5,'webinar-lightspeed-strategi-persiapan-akreditasi-2-bulan-siap-survei-akreditasi19-09-22_13:47:20_155','Webinar “Lightspeed! Strategi Persiapan Akreditasi: 2 Bulan Siap Survei Akreditasi\"','Seminar & Talkshow','Seminar',NULL,'webinar.jpg','<p>IAMARSI DIY bersama RSIA Permata Bunda akan berbagi pengalaman, tips, dan dokumen internal RS terkait persiapan akreditasi yang bisa dilakukan secara efektif dan efisien</p><p>Webinar ini memiliki opsi gratis dan berbayar</p><p>Syarat &amp; Ketentuan</p><p>1. Bila ada kendala pendaftaran/pembayaran, Anda bisa menggunakan jalur pendaftaran alternatif via</p><p><a href=\"https://bit.ly/2bulanjadi_alt\">https://bit.ly/2bulanjadi_alt</a>&nbsp;</p><p>Harap perhatikan bahwa pendaftaran menggunakan jalur alternatif tidak memberikan Anda instant access ke webinar dan membutuhkan waktu verifikasi 1x24 jam (slow respon pada H-1 dan hari acara)</p><p>2. Bagi peserta yang sudah mendaftar, link zoom dapat diakses dengan cara klik tombol \"watch here\" di e-tiket Anda</p><p>3. Untuk info terkini terkait seminar, peserta dapat bergabung dalam grup WA:</p><p><a href=\"https://chat.whatsapp.com/DA8Y9rjVUyz0qYbOPCV07I\">https://chat.whatsapp.com/DA8Y9rjVUyz0qYbOPCV07I</a></p><p>3. Sertifikat ber-SKP dan tautan dokumen akan dikirimkan melalui komunikasi pribadi via e-mail dengan peserta yang telah membayar dan terverifikasi. Sertifikat dan tautan dokumen akan dikirimkan dalam durasi 1 minggu dari acara.</p><p>4. Dokumen terenkripsi dengan OTP (one-time password), mohon siapkan space 30GB untuk download dokumen bagi pendaftar ALL ACCESS.</p>','online','-','DI Yogyakarta','Yogyakarta','2022-09-19','2022-09-19','12:00:00','14:00:00',0,'Stage and Session','https://www.instagram.com/iamarsi2021/?hl=id','https://twitter.com/IAMARSI2021','https://sites.google.com/view/iamarsi/beranda',1,'2022-09-19 11:06:24','2022-09-19 13:47:51',NULL,0,'CMqeHsQ40y166356038419-Sep-2022'),(54,5,'webinar-lightspeed-strategi-persiapan-akreditasi-2-bulan-siap-survei-akreditasi20-09-22_10:41:24_155','Webinar “Lightspeed! Strategi Persiapan Akr