0','12:00:00',0,'KOSONG',NULL,NULL,NULL,1,'2022-09-22 00:31:48','2022-09-23 10:32:05',NULL,0,'G7fGnDJ529166378150822-Sep-2022'),(56,1,'jisphoria28-09-22_09-40-20_11','JISPHORIA','Concert','Live Music & Concert',NULL,'20220908093918.jpg','<p>Experience International Concert at The Biggest Stadium in South-East Asia<br><br>Di tengah banyaknya festival musik tahun ini, JISPHORIA akan hadir dengan deretan penampil skala internasional dan juga nama-nama besar di industri musik Indonesia. Bertempat di Jakarta International Stadium (JIS), JISPHORIA akan dilaksanakan pada tanggal 1 Oktober 2022 nanti.<br>JISPHORIA sendiri adalah sebuah festival musik yang tak hanya menghadirkan penampilan musisi ternama. Dalam acara nanti, JISPHORIA juga menghadirkan area kuliner untuk para penonton.<br>Salah satu artis internasional yang sudah dipastikan tampil di JISPHORIA adalah iKON, salah satu boyband terbesar asal Korea Selatan. Penampilan boyband yang tergabung YG Entertainment di JISPHORIA ini juga menjadi pelepas dahaga para iKONIC (sebutan fans iKON) yang menunggu mereka untuk tampil di Jakarta.</p><p><br>Ada juga deretan artis nasional yang akan turut memeriahkan panggung JISPHORIA ini. Nama-nama yang tak asing seperti JKT48, Andmesh, SM*SH, dan Lyodra siap menghibur dan memberikan pengalaman tak terlupakan untuk para penonton.</p>','offline','<p>Jakarta International Stadium<br>VVF6+V2H, Papanggo, Tanjung Priok, North Jakarta City, Jakarta</p>','DKI Jakarta','Jakarta Utara','2022-10-01','2022-10-01','12:00:00','23:00:00',1,'KOSONG',NULL,NULL,NULL,0,'2022-09-28 09:40:20','2022-09-28 09:40:39',NULL,0,'0U7J8cHgna166433282028-Sep-2022'),(57,1,'smada-fiesta-viatrix28-09-22_10-32-05_1411','SMADA Fiesta “Viatrix”','Concert','Live Music & Concert',NULL,'9124A611-DE56-46FF-B791-6F9ABC2A68FB.jpeg','<p>Smada Fiesta “Viatrix”</p><p>The most exclusive show in Surabaya with two special guest stars Noah and Dewa 19 featuring Ari Lasso and Virzha yang akan diadakan pada tanggal 21 October di Gr