-03-26_1411','Student Party by Barkot','Concert','Live Music & Concert',NULL,'D2DD11E2-07D5-4792-8E94-700E1A6FD2C1.jpeg','<p>Jangan lewatkan konser dan party bersama host dan<br>guest star kern di malam Minggu, tanggal 1 Oktober<br>2022 di Graha Unesa Lidah Wetan, Surabaya.<br>Buruan daftar dan ajak teman-teman kalian,, Htm<br>Gratis Loh…</p>','offline','<p>Graha Unesa, Lidah Wetan Surabaya</p>','Jawa Timur','Surabaya','2022-10-01','2022-10-01','12:00:00','12:00:00',1,'KOSONG',NULL,NULL,NULL,0,'2022-09-28 11:03:26','2022-09-28 11:03:31',NULL,0,'o0nkSKsvNP166433780728-Sep-2022'),(61,1,'bbo-konser-musik-jatim-fair28-09-22_11-06-58_1411','BBO Konser Musik Jatim Fair','Concert','Live Music & Concert',NULL,'FF8BA59E-A1F1-4E20-8B39-7B54396ED803.png','<p>[JATIM FAIR 13th 2022]</p><p><br>BBO Konser Musik Jatim Fair 2022 akan<br>diselenggarakan pada tanggal 7-13 Oktober 2022 di<br>Grand City Convex, Surabaya.<br>Saksikan penampilan dari Tulus, Feel Koplo,<br>Fourtwnty, Tipe-X, Ndarboy Genk, Guyon Waton,<br>Dere, Lomba Sihir, Jason Ranti dan masih banyak<br>lagi.</p>','offline','<p>Grand Ciry Convex Surabaya</p>','Jawa Timur','Surabaya','2022-10-07','2022-10-13','12:00:00','12:00:00',1,'KOSONG',NULL,NULL,NULL,0,'2022-09-28 11:06:58','2022-09-28 11:07:05',NULL,0,'V5NpYehLA6166433801828-Sep-2022'),(62,1,'pet-vaganza-202228-09-22_11-14-13_1411','Pet Vaganza 2022','Festival & Fair','Show & Festival',NULL,'D844F7DA-C313-4C28-81A2-CAA28959F406.jpeg','<p>Siapa nih yang kangen lihat Kura-kura, Ular, Sugar Glider dan Reptil?</p><p><br>Yuk datang ke Pet Vaganza<br>23 September- 2 Oktober 2022<br>Atrium Ground PTC<br>&nbsp;</p><p>Jangan sampai kelewatan ya karena ada Sugar Glider<br>Contest &amp; Reptile Contest di seberang area Funimal<br>Ground PTC</p><p><br>Sampai jumpaaa!</p>','offline','<p>Pakuwon Tradee Center - Atrium, Ground Floor</p>','Jawa Timur','Surabaya','2022-09-23','2022-10-02','12:00:00','12:00:00',1,'KOSONG',NULL,NULL,NULL,0,'2022-09-28 11:14:13','2022-09-28 14:16:09',NULL,0,'z6HIJBwDwZ166433845328-Sep-2022'),(63,21,'medication-wellness-journey-holistic-wellness-retreats-in-bali15-10-22_21-11-10_16321','Medication & Wellness Journey - Holistic Wellness Retreats in Bali','Accommodation','Attraction',NULL,'BALI- MEDICATION & WELLNESS (1)-1.jpg','<p>Medical Tourism adalah Platform yang menghubungkan ekosistem wisata dan industri medis di Indonesia. Kami membantu, memfasilitasi dan mempromosikan “ Healthcare Travel Industry yang ada di Indonesia untuk dikenal didalam maupun luar negeri.<br>&nbsp;</p>','offline','<p>Jalan Raya Penestanan Kelod, Sayan, Kecamatan Ubud, Kabupaten Gianyar, Bali 80571</p>','Bali','Gianyar','2022-12-02','2022-12-04','12:00:00','12:00:00',1,'Stage and Session Media Partner','https://instagram.com/medicaltourism.id',NULL,'https://medicaltourism.id',0,'2022-10-15 21:11:10','2022-10-17 08:51:37',NULL,7,'4kL3Zi7Gdo166584307015-Oct-2022'),(64,22,'garuda-indonesia-travel-fair-202219-10-22_11-12-40_16522','Garuda Indonesia Travel Fair 2022','Festival & Fair','Exhibition',NULL,'GATF_WEB BANNER AGENDA KOTA.jpg','<p>Still remember how exciting it was to hunt for airfare promos while booking all your travel needs with the best GATF offers?</p><p>This year, we will bring back the Garuda Indonesia Travel Fair with a new Exhibition Concept comes to life at “GATF 2022”. The organizers of the GATF 2022, the new exhibition concept addressed especially to travellers, hoteliers, culinary, automotive, property, sports enthusiast, happy family, promised innovation and that is exactly what we delivered, judging by the show’s main entrance.</p><p>The experience begins while walking towards the exhibition area, visitor will visiting a one-stop shop area and hunt our promos.</p><p>Garuda Indonesia Travel Fair is Biggest Travel Fair held by Garuda Indonesia to offer any kind of ticket to every domestic and international trip destination.</p>','offline','<p>Indonesia Convention Exhibition BSD (ICE BSD)&nbsp;</p>','Banten','Tangerang','2022-10-28','2022-10-30','09:00:00','21:00:00',1,'KOSONG',NULL,NULL,NULL,0,'2022-10-19 11:12:40','2022-10-20 15:30:57',NULL,0,'i8bgc2yf1m166615276119-Oct-2022'),(65,1,'koridor-co-working-space-open-house-202220-10-22_17-09-21_11','Koridor Co-Working Space Open House 2022','Meet-up& Gathering','Talkshow',NULL,'koridor.jpg','<p><strong>Where bright minds bring &nbsp;bright ideas to life — in two days</strong></p><p>Memperkenalkan Koridor dengan &nbsp;mempertemukan startups, communities, &nbsp;stakeholders, pemilik inkubator, talents, dan &nbsp;investors di satu tempat, yakni Koridor Co- &nbsp;working Space<br>&nbsp;</p><p><strong>Give young people in Surabaya &nbsp;opportunity to learn from &nbsp;experienced entrepreneurs</strong><br>Mengundang anak-anak muda Surabaya &nbsp;untuk berkunjung ke Koridor dan berkenalan &nbsp;dengan Startup Koridor, membuka &nbsp;kesempatan bagi startup untuk menyerap &nbsp;talenta baru</p><p><strong>Network with bright and &nbsp;passionate minds</strong><br>Mempertemukan pelaku usaha dari berbagai &nbsp;bidang untuk saling berjejaring</p><p><strong>Start something new and amazing</strong><br>Membuka kesempatan bagi terciptanya &nbsp;kolaborasi-kolaborasi baru untuk Surabaya &nbsp;Hebat.</p><p><strong>Nama Acara :</strong> Koridor Anniversary&nbsp;&amp; Open house&nbsp;<br><strong>Tempat acara </strong>: Koridor Co-Working Space, Siola lt 3, Jl. Tunjungan No.1 Surabaya</p><p><strong>Tanggal :</strong> 12-13 November 2022<br><strong>Waktu :</strong> 09.00 - 21.00 WIB</p><p><strong>Ragam Kegiatan :</strong><br><strong>1. Workshop :</strong>&nbsp;<br>Open collaboration with any &nbsp;potential speakers from &nbsp;startups, communities, or &nbsp;expert startup mentors</p><p><strong>2. Talkshow :</strong><br>Open collaboration with any &nbsp;potential speakers from &nbsp;startups, communities, or &nbsp;expert startup mentors</p><p><strong>3. Meet the Startup:</strong><br>Kesempatan bertemu dan berkolaborasi dengan Startup Koridor Co-Working Space Surabaya</p><p><strong>4. Exhibition Startup &amp; UMKM Surabaya :</strong><br>Pameran Startup dan &nbsp;UMKM Ekraf Surabaya dan menjual &nbsp;produknya</p><p><strong>5. Live Music&nbsp;</strong><br>Live Music by Komunitas Musik Surabaya di Taman Gantung Koridor Coworking Space</p><p><strong>6. Koridor Startup Hunt \" Picthing Competition\"</strong><br>Pencarian Startup baru di koridor dan picthing competition melibatkan Startup Surabaya</p><p><strong>7. Klinik UMKM by Tatarupa</strong><br>Membantu UMKM di Surabaya meningkatkan value produk dengan desain kemasan, Strategi marketing oleh tatarupa</p><p><strong>8. Film, Games&nbsp;</strong></p><p>dan Masih banyak lainnya.</p><p><br>&nbsp;</p>','hybrid','<p>Koridor Co-Working Space, Siola, Tunjungan St No.1, Genteng, Surabaya City, East Java 60275</p>','Jawa Timur','Surabaya','2022-10-21','2022-11-13','10:30:00','21:00:00',0,'Stage and Session Sponsors Exihibitors Media Partner Stage and Session','https://instagram.com/koridor.space',NULL,'https://koridor.surabaya.go.id',0,'2022-10-20 17:09:21','2022-10-21 10:03:18',NULL,0,'e9BNdL1OmY166626056220-Oct-2022');
