s','DAILYHOTELS','','Media','Conference','','',NULL,NULL,NULL,NULL,'bebas','2022-08-15 13:51:16','2022-08-15 13:51:16',NULL),(11,90,'bebas-eo','bebas EO','','Brand','Concert','','',NULL,NULL,NULL,NULL,'wkjsbshxbhb bsjsb','2022-08-15 13:51:27','2022-08-15 13:51:27',NULL),(13,97,'indigospace-surabaya','IndigoSpace Surabaya','','Brand','Accommodation','','',NULL,NULL,NULL,NULL,'IndigoSpace Surabaya merupakan coworking space dan creative centre. Induk organisasinya adalah Indigo, yaitu inkubator dan akselerator milik Telkom Indonesia.','2022-08-16 15:17:07','2022-08-16 15:17:07',NULL),(14,1,'ihub','IHUB','','Co-working Space','Conference','','',NULL,NULL,NULL,NULL,'A creative space dedicated to entrepreneurship, innovation, and research for curious minds','2022-08-22 13:55:51','2022-08-22 13:55:51',NULL),(15,120,'pt-debindo-mitra-tama','PT Debindo Mitra Tama','','Event Organizer','Exhibition','','',NULL,NULL,NULL,NULL,'Debindo Mitra Tama stems from debindo Multi Adhiswasti,Surabaya branch that has been doing exhibition as well as the event executing more than 100 times in East java and Eastern Indonesia since its establishment in 1994. Debindo Mitra Tama standing on 7 january 2010was the company’s leading Professional Event organizer in Surabaya purely from Surabaya.\r\n\r\nStarting from the property exhibition which later developed batik & fashion exhibition, tourism fair, furniture fair, building materials expo, etc., and workingwith parners to establish associations, institutions, agencies make Debindo Mitra Tama as a reliable exhibition organizer for the provincial and district/city, state owned enterprises, private sector, and society.\r\n\r\nThe climax was the “Jatim Fair” which held by DMT with a partner, making this exhibition is the likewise, later expanding exhibition to other regions such as Bali, Medan, Samarinda  and Yogyakarta makes DMT more professional  and experienced EO position.','2022-08-22 14:30:15','2022-08-22 14:30:15',NULL),(16,139,'himpunan-mahasiswa-teknik-informatika-itn-malang','Himpunan Mahasiswa Teknik Informatika ITN Malang','','University','Workshop','','',NULL,NULL,NULL,NULL,'HATI merupakan salah satu organisasi himpunan mahasiswa di ITN malang yang mana ini merupakan organisasi yang mewadahi semua ide - ide dan kreativitas dari mahasiswa teknik informatika ITN malang.','2022-08-30 08:52:05','2022-08-30 08:52:05',NULL),(17,143,'holiday-inn-jakarta-kemayoran','Holiday Inn Jakarta Kemayoran','','Brand','Accommodation','','',NULL,NULL,NULL,NULL,'Whether travelling for business or leisure, our accommodation in Jakarta offers comfort and convenience for all guests. The luxury rooms and suites at our hotel near Jakarta International Expo are relaxing and spacious offering a welcome retreat from the bustling city. The elegantly designed guest rooms provides spectacular city skyline views and include a range of modern amenities to make you feel at home.','2022-09-09 12:16:40','2022-09-09 12:16:40',NULL),(18,141,'agendakota','AgendaKota','','Startup','Exhibition','','',NULL,NULL,NULL,NULL,'AgendaKota adalah platform yang bisa kamu gunakan untuk mempublikasikan event kamu dan memudahkan kamu untuk membuat event virtual, on-site, dan hybrid.','2022-09-14 16:15:30','2022-09-14 16:15:30',NULL),(19,151,'koridor-co-working-space','Koridor Co-Working Space','','Co-working Space','Seminar & Talkshow','','',NULL,NULL,NULL,NULL,'xxx','2022-09-27 15:15:22','2022-09-27 15:15:22',NULL),(20,160,'musikawan','musikawan','','Other','Conference','','',NULL,NULL,NULL,NULL,'musikawan adalah band asal surabaya yang terbentuk sejak tahun 2016, dan sudah ada 6 single kami yang telah rilis di digital platform musik, kami sempat break 3 - 4 bulan di akhir tahun 2021, dan dibulan ini kami akan rilis mini album, dan ingin mengadakan acara pers conference dan hearing session sebelum rilis album kami','2022-10-09 18:43:55','2022-10-09 18:43:55',NULL),(21,163,'medicaltourism-indonesia','Medicaltourism Indonesia','icon.png','Startup','Accommodation','halo@medicaltourism.id','08113279599','https://instagram.com/medicaltourism.id','https://www.linkedin.com/company/medical-tourism-indonesia/',NULL,'https://medicaltourism.id','Medical Tourism adalah Platform yang menghubungkan ekosistem wisata dan industri medis di Indonesia. Kami membantu, memfasilitasi dan mempromosikan “ Healthcare Travel Industry yang ada di Indonesia untuk dikenal didalam maupun luar negeri.','2022-10-15 21:07:01','2022-10-15 21:32:52','_banner_medicaltourism-indonesia21_medical tourism-indonesia.png'),(22,165,'dyandra-promosindo','Dyandra Promosindo','Untitled-1.png','Event Organizer','Festival & Fair','info@dyandra.com','02131996077',NULL,NULL,NULL,'','Dyandra Promosindo is a leading professional exhibition organizer (PEO) in Indonesia, a sub-holding company of PT Dyandra Media International, Tbk (DYAN). Established since 1994, Dyandra Promosindo has organized more than 1100 exhibitions in Jakarta, Surabaya, Yogyakarta, Bali, Makassar, Medan, and other major cities in Indonesia.','2022-10-18 16:19:34','2022-10-18 16:51:58',NULL),(23,168,'himpunan-mahasiswa-manajemen-pemasaran','Himpunan Mahasiswa Manajemen Pemasaran','','University','Seminar & Talkshow','','',NULL,NULL,NULL,NULL,'Himpunan Mahasiswa Prodi Manajemen Pemasaran Universitas Airlangga','2022-10-20 21:09:35','2022-10-20 21:09:35',NULL),(24,174,'elcampmusic','ELCAMPMUSIC','','Music','Show & Performance','','',NULL,NULL,NULL,NULL,'Ikulah','2022-10-21 10:46:46','2022-10-21 10:46:46',NULL);
